(1, 1, 1, 1, '2007-05-04 11:50:25', '2008-01-21 15:16:19', '1982-09-14', '2005-07-11', 'Web Developer', 'I have been experimenting with code for the web since 1999, but after graduating in 2005, I pursued a career in web development. I came straight from university and landed the role of Web Developer at Creation — a design agency which, to my surprise and relief, already understood the merits of web standards and best practices. The first few months were tough as I was thrown in to the deep end, but I have now been at Creation for over two years and it is great fun. With a great design team I am able to produce beautifully visual yet functional and semantic websites. With an ever growing set of standard code principles (including [microformats](http://microformats.org)) I have been able to develop [web site packages](/services/websites/) for a multitude of clients — further proof web standards is the best way to develop.\r\n\r\nAs the sole web developer, I undertake every aspect of the web *development* process (except for the design). I structure and implement the databases, write the server-side code (currently PHP). Front end code is controlled by semantic HTML which is styled with CSS and progressively enhanced with JavaScript (custom or [jQuery](http://jquery.com)). I also advise on best practices for usability and interface design when creating the design visuals. Because of this process we are quashing the belief that accessible websites are boring — our websites are **accessible and beautiful**.', '####I Enjoy…####\r\n\r\n* Watching movies\r\n* Listening to music\r\n* Playing with new gadgets\r\n* Surfing the web for hours (some times days) on end!\r\n\r\n####A Few Facts####\r\n\r\n* I don\'t drink alcohol or smoke\r\n* I drink tea — milk, no sugar\r\n* I am left handed\r\n* I gave up coke in 2006\r\n\r\n####My Life Online####\r\n\r\nBecause I spend so much time on the web I often sign up to a lot of newly released websites. Take a look at a few of my profiles on services which you might enjoy.\r\n\r\n* [Last.fm](http://www.last.fm/user/trovster/) — music I\'m listening to\r\n* [Flickr](http://www.flickr.com/photos/trovster/) — a great photo sharing community\r\n* [delicious](http://del.icio.us/trovster) — favourite links / bookmarks\r\n* [twitter](http://twitter.com/trovster) — what I\'m doing\r\n* [tumblr](http://trovster.tumblr.com) — random things of interest\r\n\r\n####Top Five Favourite Movies####\r\n\r\n1. The Prestige\r\n2. Eternal Sunshine of the Spotless Mind\r\n3. Amores Perros\r\n4. Memento\r\n5. The Assassination of Jesse James by the Coward Robert Ford \r\n\r\n####Top Five Favourite Foreign Movies####\r\n\r\n1. Amores Perros (Spanish)\r\n2. The Lives of Others (German)\r\n3. Funny Games (German)\r\n4. High Tension (French)\r\n5. City of God (Portuguese)\r\n\r\n####Top Five Favourite Bands####\r\n\r\n1. Motion City Soundtrack\r\n2. Less Than Jake\r\n3. Yellowcard\r\n4. Reel Big Fish\r\n5. Plain White T\'s'),
(2, 1, 2, 2, '2006-10-17 16:40:09', '2008-01-11 19:19:39', '1968-03-21', '1995-02-23', 'Managing Director', 'After five years being employed as a designer and building up freelance clients came the day of Creation on 1st August 1995. It was a leap of faith at the time and without the support of my wife it probably wouldn\'t have happened. I feel lucky to be working with a world class design team and a bunch of true friends. We\'ve built up some very strong relationships with our clients over the years. Thanks to them our job has been made much more enjoyable. We all try to offer the very best of creative thinking to help your business grow.', '####My role…####\r\n\r\nIs to promote growth and direction for Creation. We try and do this by offering clients the perfect service and building a happy working environment for the team.\r\n\r\n####Likes…####\r\n\r\nMotorbikes, cars, motorbikes, good veggie food, motorbikes, art, motorbikes, music, motorbikes, laughing, motorbikes, India, motorbikes, animals, motorbikes, keeping fit, motorbikes, doing a good deed.\r\n\r\n####Place to be…####\r\n\r\nLying on a riverbank, hot sunny day, eyes closed, listening to the distant noise of light aircraft and worrying about nothing. Or riding a Royal Enfield Bullet in India when the weather is fantastic, knowing it is cold and wet in the UK.\r\n\r\n####Top fourteen tracks…####\r\n\r\nAngel Eyes (Roxy Music), Adagio for Strings (Barber), Being Boiled (Human League), Chatter (Autechre), Computer World (Kraftwerk), Free Bird (Lynyrd Skynyrd), Glory Box (Portishead), Killer (Adamski), Le Onde (Ludovico Einaudi, piano), Module (Zero B), Papua New Guinea (The Future Sound of London), River Man (Nick Drake), Sliced Tomatoes (Just Brothers), Technologicque Park (Orbital).\r\n\r\n####Coming up in 2008…####\r\n\r\n* <del>Launch Off The Wall India</del>\r\n* Trip to India\r\n* Visit all my friends\r\n* Some severe saving\r\n* Beat Trev at squash\r\n* Go green laning on my XR400\r\n* Stafford Half Marathon\r\n* Be 40</del>\r\n* Do 10k runs</del>\r\n* Trip to the Isle of Man TT\r\n* Another trip to the Nürburgring\r\n* Start a World Championship\r\n* Be nicer to everyone'),
(3, 1, 1, 3, '2006-10-17 16:40:09', '2006-10-17 16:40:09', '1969-06-15', '1995-08-23', 'Creative Director', 'My role is to initiate creative ideas that help people to communicate. To create brands that help to promote our clients\' products and services and help my team to maintain consistent delivery of these brands.\r\n\r\nI want people, when they see our work, to think, \"someone must enjoy their work to get these results.\" When your heart is in your work it shows. My favourite pieces are not the biggest projects for the largest clients, but the projects where I have been trusted with the freedom to deliver my best. You can\'t measure ability by years of service - that would only cover about half of the effort and commitment that I have invested into Creation. I\'m lucky to get paid for doing something that I love - it\'s my life. And I hope it shows in my work.', '####I sometimes wonder…####\r\n\r\n* What creature will discover man\'s extinction?\r\n* If you can catch bad luck like you can a common cold?\r\n* Why some adults wear novelty socks?\r\n\r\n####Favourite Sounds####\r\n\r\n* The first few glugs from a bottle of single malt\r\n* A Roland TB-303, TR808 & TR-909\r\n* Distant rolling thunder\r\n* The rarest sound of all - silence (which is pretty rare indeed when you have tinnitus)\r\n\r\n####If a conversation hits that awkward silence, just ask…####\r\n\r\n* If you were presented with the opportunity to leave this planet (alone) in a UFO, would you have the bottle to go?\r\n* If someone you hated died, would you feel a little bit guilty?\r\n* Do great ideas get resisted initially because they alter the power balance of a relationship?\r\n* Which song do you wish you had written?\r\n\r\n####If I had to live on one food forever it would be…####\r\n\r\nJack Daniel\'s roasted Buffalo Wings (TGI Fridays)'),
(4, 1, 1, 4, '2006-10-17 16:40:09', '2006-10-17 16:40:09', '1978-04-21', '2003-08-06', 'Senior Designer', 'I\'ve been part of the Creation team since 2003 and having worked with several other agencies, I can safely say this feels like home. Creation is an environment where I can involve our clients in the design process, and allow them to make informed and exciting decisions for their communication needs.\r\n\r\nWhether consciously or not, modern lifestyles require making design-based decisions, and most people recognise good design when they see it — my role is to ensure that\'s exactly what they get. \r\n\r\nGood design isn\'t elitist, it\'s empowering.', '####Resolutions this year…####\r\n\r\n* Have a beer if I want one\r\n* To not get so wound-up by bad drivers\r\n* To not put Encona Hot Pepper Sauce on everything\r\n\r\n####I love…####\r\n\r\n* Summer\r\n* Cars\r\n\r\n####In my dreams…####\r\n\r\nI\'d live in Sorrento, and have to drive the Amalfi coast road to \'creation Italia\' every day… in my gunmetal-grey Gallardo Spyder.\r\n\r\n####Proudest moment…####\r\n\r\nBeing at the birth of my gorgeous daughter\r\n\r\n####Pet hates…####\r\n\r\n* Tea pots that don\'t pour — come on, how hard can it be?\r\n* Debt-consolidation adverts\r\n* Drivers who don\'t indicate. Ever.\r\n\r\n####My sanctuary is…####\r\n\r\nThe basketball court'),
(5, 1, 1, 5, '2006-10-17 16:40:09', '2006-10-17 16:40:09', '1972-09-14', '1998-02-13', 'Office Manager', 'I joined my brother and the team at Creation nine years ago with seven years of administration and office management experience. I assist everyone with the smooth running and efficiency of the studio. Over the years I have become more involved in the running of the business and deal with all the financial aspects as well as administration and human resources. My main objective is to maintain our high quality customer care.', '####It makes me happy when…####\r\n\r\n* I am with my children and partner\r\n* Spring arrives and the first flowers bloom and we have colour and daylight\r\n* I can go outside without a coat\r\n\r\n####One day I will…####\r\n\r\n* Visit Mexico, Brazil and LA\r\n* Ride the dragster roller coaster at [cedar point](http://www.cedarpoint.com)\r\n* Get married again\r\n\r\n####The best food ever is…####\r\n\r\nCake\r\n\r\n####My Top 5 Films####\r\n\r\n1. The Illusionist\r\n2. Pirates of the Caribbean\r\n3. Harry Potter\r\n4. Mars Attacks\r\n5. Blade\r\n\r\n####My Top 5 TV Shows####\r\n\r\n1. Heroes\r\n2. Supernatural\r\n3. 24\r\n4. Lost\r\n5. Waking the Dead\r\n\r\n####Future Events####\r\n\r\n* Trip to Orlando later this year\r\n* Wedding in 2008');
