(1, 1, 1, 2, '2007-05-04 11:04:34', '2007-05-04 11:04:34', 'A Modern Classic', 'a-modern-classic/', 'The new Ducati 1098 is going to be available soon.', 'The [new Ducati 1098](http://www.ducati.com/en/bikes/my2007/ModelPage.jhtml;jsessionid=E20SOTHTWRTDKCRNCB2SFFAKFUIHUIV4?family=Superbike&model=SBK1098STRICOLORE-07) is available now. A fantastic looking bike and perhaps another design classic from Ducati. It\'s the replacement for the \'not so popular\' 999 and to regain it\'s appeal has similar features to the 916 range of bikes produced between 1994 and 2002. I want one, but they ain\'t cheap, especially the 1098 S Tricolore shown below.', 'Ducati 1098', '', '', 'jpg', '1'),
(3, 1, 1, 3, '2007-02-05 10:27:40', '2007-02-05 10:27:40', 'True Car Crash TV!', 'true-car-crash-tv/', 'Richards Hammond\'s horrific car accident.', 'I\'m finally getting some return for my TV licence - welcome back Top Gear! A refreshing break from cringe worthy \'Car Crash\' reality TV shows although in the first episode Richard Hammond\'s truly death defying 314mph car crash was aired. The \'Hamster\' is a really nice bloke and my prayers were answered, it seems, as he made a full recovery - phew!\r\n\r\nYou can see [Hammond\'s accident on the Top Gear website](http://www.bbc.co.uk/topgear/show/episodes/series9episode1.shtml)\r\n\r\nP.S. Ray Meers is worth a couple of quid of the licence fee too.', 'Richard Hammond in crash helmet', 'Richard \'The Hamster\' Hammond', '', 'jpg', '1'),
(4, 1, 1, 5, '2007-02-05 10:42:44', '2007-02-05 10:42:44', 'Holly', 'holly/', 'Holly my new Shih tzu puppy.', 'On December 21st we had a new addition to our family, Holly, a Shih tzu puppy. She was born on 2nd November 2006 and is growing fast. When we first had her you could hold her in the palm of your hand. The whole family love her to bits.', 'A Shih Tzu puppy', '', '', 'jpg', '1'),
(5, 1, 1, 4, '2007-02-07 11:57:09', '2007-02-07 11:57:09', 'Power to the People', 'power-to-the-people/', 'A hot-hatch is the everyday super-car.', 'I\'ve owned a hot hatch (Civic Type R). I sold it just before our daughter was born when I had a major attack of the \'Mr. Sensible Shoes\', and chopped it in for a 5 door diesel, which in hindsight wasn\'t as smart as it might sound. The Type R took us, fully loaded, to the South Coast and back quietly and rapidly; to IKEA to collect flat packed wardrobes; to the refuse-site when I ripped out my old kitchen; to restaurants and pubs on Summer evenings, never out-gunned by Boxters and BMWs, and on some of the best drives I\'ve ever had. For me, the hot-hatch is the everyday super-car, bringing performance and practicality to the masses. If I was in the market for another all-round super hero, it would be the Focus ST — quick, spacious, capable and with a bullet proof 5 cylinder engine courtesy of Volvo, it ticks all the boxes. I wonder if they come with baby-sick resistant seats…', 'Blue Focus ST', 'Focus ST', '', 'jpg', '1'),
(6, 1, 1, 4, '2007-04-26 11:18:10', '2007-04-26 11:18:10', 'See no evil, hear no evil…', 'see-no-evil-hear-no-evil/', 'I\'ve finally bought a new telly (Samsung LE32R74). It looks slick, has integrated digital and great picture quality.', '**Tim:** Isn\'t it typical, your TV breaking just before Christmas.  \r\n**Rich:** Eh?  \r\n**Tim:** You know, watching the portable TV from the bedroom.  \r\n**Rich:** That *is* my TV.  \r\n\r\nAfter suffering years of ridicule from Tim about my lounge TV I\'ve celebrated with the purchase of a new one — a 32\" LCD Samsung LE32R74. It\'s beautifully designed, 1080i HD Ready with integrated Freeview and has fantastic picture quality. Eye strain is now a thing of the past, so now all I\'ve got to do is get a new car and Tim might give me some peace…', 'Samsung 32\" LCD', '', '', 'jpg', '1'),
(7, 1, 1, 3, '2007-04-02 12:53:55', '2007-04-02 12:53:55', 'Gone But Not Forgotten', 'gone-but-not-forgotten/', 'March 2007 saw the long awaited arrival of my Mk5 VW Golf GTi.', 'Spring is in the air, bluebells carpet the shady woodlands I pass on the daily commute, and all this is made sweeter as March saw the long awaited arrival of my Mk5 VW Golf GTi. Of course the GTi is out gunned by hotter hatches but at that pace you\'ll miss all of the lovely bluebells.\r\n\r\nI must pay respects to my old Mk4 VW Golf GT TDi PD — thanks for all the years of reliable service — you carried both of my children safely home from hospital. Not a glitch in nearly six years — you\'re gone but not forgotten.', 'Mark 4 VW Golf GT TDi (Reflex Silver)', 'Carding Mill Valley, Shropshire, 16-09-2003', '', 'jpg', '1'),
(8, 1, 1, 1, '2007-05-04 13:04:48', '2007-05-04 13:04:48', 'Unlimited Cinema Pass', 'unlimited-cinema-pass/', 'Cineworld have a promotion called the Unlimited Card. This card allows you to enjoy any film for free.', 'Cineworld, a chain of multiplex cinemas in the UK, have a promotion called the Unlimited Card. This card allows you to enjoy any film, on any day and at any time for just £10.99 a month. If you visit the cinema more than twice a month, the price is definitely worth it.\r\n\r\nI have found the promotion allows you the freedom to explore movies you might have otherwise not seen — and the ability to leave during terrible ones!', 'A bowl of popcorn', '', '', 'jpg', '1'),
(9, 1, 1, 5, '2007-05-04 13:29:50', '2007-05-04 13:29:50', 'Tae Kwon Do Red Stripe', 'tae-kwon-do-red-stripe/', 'I successfully passed my Red Stripe grade in Tae Kwon Do.', 'On the 10th May I successfully passed my grade for Red Stripe in Tae Kwon Do, as I get ever nearer to the Black Belt the syllabus becomes more difficult and challenging.\r\n\r\nI started the sport in December 2003 and joined my twin sister who decided to start again after taking a break to have her children. I would like to take the opportunity to thank my instructor and other members of the club for all their support. I hope to continue the sport for many years to come. Please visit the club website.', 'Two Penkridge Tae Kwon Do club members two step sparing', 'I know Kung-Fu', '', 'jpg', '1'),
(10, 1, 1, 3, '2007-06-14 13:31:22', '2007-06-14 13:31:22', 'Fathers Day', 'fathers-day/', 'This Sunday I will be thinking of my father Robert Webley.', 'This Sunday I will be thinking that I was strong enough to watch you go, but not brave enough to tell you that I loved you.\r\n\r\n**Robert Webley**  \r\n14.12.1942 – 17.12.2006', 'Robert Webley', 'Robert Webley', '', 'jpg', '1'),
(11, 1, 1, 3, '2007-06-18 15:33:21', '2007-06-18 15:33:21', 'If you can\'t beat em with it…', 'if-you-cant-beat-em-with-it/', 'Recently I brought a new mobile phone - a Sony Ericsson w810i.', 'Everywhere I go I see people pawing over their mobiles, mainly while driving, going through the checkout at Sainsbury\'s or sitting in front of me at the cinema, you know those kind of emergency scenarios. So I guess I\'m in the minority here because to me a mobile phone is more of life buoy than a \'snooky\' comfort blanket. I don\'t care what it looks like and, should I ever need it, will be damn glad it\'s there. I fought the temptation of an upgrade for years while those around me were deep in 3G video conferences at the traffic lights, but then I hit a point of realization. My old Nokia 8310e went off in my pocket at the park and sounded like a free Happy Meal toy. Shame.\r\n\r\nSo I dropped into the nearest Carphone Warehouse and brought the only one in the shop that Paris Hilton wouldn\'t be seen dead with - the [Sony Ericsson w810i](http://www.sonyericsson.com/spg.jsp?cc=gb&lc=en&ver=4000&template=pip1&zone=pp&pid=10376) and it\'s truly great. I sometimes get it out as I walk to the cash machine to check if I have missed a call – that way the kids will think I am in demand. Safe.\r\n\r\nOh yeah, and if it\'s illegal to use your phone while driving, why is it call the Carphone Warehouse?', 'Sony Ericsson w810i', '', '', 'jpg', '1'),
(12, 1, 1, 1, '2007-06-19 13:16:16', '2007-06-19 13:16:16', 'Threadless', 'threadless/', 'Threadless is a company where you can buy some awesome tees.', '[Threadless](http://www.threadless.com/?streetteam=trovster) is not only a simple t-shirt company – they\'re a lot more! The site is based on a simple premise – tees designed and voted-for by users make awesome t-shirts. You participate and decide on what t-shirts are made, then you buy them! \r\n\r\nThe cool thing is if you don\'t like any of the tees (but you will), you can submit your own design (which then is voted upon). Every week four to six designs are chosen and if one is yours then you get $2000 in cash prizes. Every run is restricted, so not only are they *utterly cool*, they\'re straight-out wicked limited-editions!\r\n\r\nI have a stupid amount of their t-shirts already, and although they\'re based in America, the shipping when ordering multiple t-shirts is decent. So go on, go [start wearing some awesome t-shirts](http://www.threadless.com/?streetteam=trovster) and be \"nude no more\".', 'Threadless Logo & Nude No More', 'Nude No More!', 'http://www.threadless.com/?streetteam=trovster', 'gif', '1'),
(13, 1, 1, 4, '2007-06-19 15:26:05', '2007-06-19 15:26:05', 'Happy Anniversary', 'happy-anniversary/', 'Wishing Happy Anniversary to my beautiful wife.', 'I\'d like to wish my beautiful wife a Happy Anniversary today – you\'ve already given me three great years and a gorgeous daughter, so when I win the lottery I might just be able to repay you.', 'Rich & Heloise', '', '', 'jpg', '1'),
(14, 1, 1, 2, '2007-06-27 15:34:43', '2007-06-27 15:34:43', 'King Lear', 'king-lear/', 'I went to see King Lear performed by the RSC in Stratford.', 'This month I am mostly interested in art and Shakespeare. The Royal Academy\'s annual [Summer Exhibition](http://www.royalacademy.org.uk) on TV has inspired me to get back to my roots and get messy. Then seeing the [RSC](http://www.rsc.org.uk \"Royal Shakespeare Company\") performance of [King Lear](http://www.rsc.org.uk/newsandevents/events/5375.aspx) reminds me of how much I love to watch Shakespeare\'s plays performed live on stage. [Much Ado About Nothing](http://www.staffordfestivalshakespeare.co.uk) is next, on an outdoor stage at Stafford Castle, always a treat. We are going on the last night to experience all the fireworks and fun.', 'Sir Ian McKellan as King Lear', '', '', 'jpg', '1'),
(15, 1, 1, 3, '2007-06-29 15:06:05', '2007-06-29 15:06:05', 'Celebrating…', 'celebrating/', 'Happy Birthday Robyn.', 'Today is the 3rd anniversary of one of the most stressful days of my life - my daughter\'s birthday. (It was pretty stressful for my wife too I guess).\r\n\r\nHappy Birthday Robyn.\r\n', 'Robyn Webley - Age 3', '', '', 'jpg', '1'),
(16, 1, 1, 1, '2007-07-02 17:12:14', '2007-07-02 17:12:14', 'Ctrl+Alt+Del', 'ctrl-alt-del/', 'Ctrl+Alt+Del is an online comic following two video-game obsessed twenty-somethings.', '[Ctrl+Alt+Del](http://www.ctrlaltdel-online.com) is an online comic written and illustrated by Tim Buckley. The comic mainly follows the antics of Ethan and Lucas, two video-game obsessed twenty-somethings, in their general life. Most of the storylines and jokes make fun of the computer game industry as well as all things geek related!\r\n\r\nThe comic strip is now a fully [animated series](http://www.cad-animation.com \"Ctrl+Alt+Del: The Animated Series\") featuring [twelve episodes](http://en.wikipedia.org/wiki/List_of_Ctrl%2BAlt%2BDel:_The_Animated_Series_episodes) which has also just been released on DVD. If you like the comics, the animated series is definitely worth the purchase.', 'Ctrl+Alt+Del Logo', '', 'http://www.ctrlaltdel-online.com', 'gif', '1'),
(17, 1, 1, 1, '2007-07-16 15:37:07', '2007-07-16 15:37:07', 'BTCC at Donington', 'btcc-at-donington/', 'Review of the sixth round of the British Touring Car Championship at Donington Park.', 'This weekend saw the sixth round of the [British Touring Car Championship](http://www.btcc.net) at [Donington Park](http://www.donington-park.co.uk)\r\n\r\nGordon Shedden in his Team Halfords Honda Civic won the first BTCC race of the day. However, Jason Plato driving for SEAT Sport UK in a new-shape Leon dominated the second. Plato drove brilliantly in heavy rain on a track which was hazardous with a lot standing surface water. He pulled away from the field and won comfortably in the second race of the day after passing the first-race winner early on.\r\n\r\nIn the final race of the day, starting from ninth on the grid, Plato was some how able to quickly move through the field, losing the lead briefly but managing to secure his second win of the day, and his fifth of the season. This meant he extended his lead in the Championship over second place Fabrizio Giovanardi who had a poor weekend.\r\n\r\nYou can view some of the [photos I took from the weekend](http://www.flickr.com/photos/trovster/sets/72157600839710905/)\r\n\r\nFinally, I would like to thank Steve for providing us with the passes for the weekend and for lending us an umbrella which kept us from getting soaked!', 'Jason Plato in his SEAT Sport UK Leon', '', '', 'jpg', '1'),
(18, 1, 1, 2, '2007-08-14 13:05:59', '2007-08-14 13:05:59', 'Nürburgring (Nordschleife)', 'nurburgring-nordschleife/', 'Driving around the Nürburgring in my BMW Z4', 'Last weekend my brother and I went to the famous [Nordschleife](http://en.wikipedia.org/wiki/N%C3%BCrburgring) in Germany, the former F1 venue where Niki Lauda crashed in 1976. I can honestly say it was proper scary on the track. After seeing a written off Z4 M coupe being taken away before we did our first lap (I was in my Z4 – gulp), we then had a close shave when a VX220 spun off in front of us and threw up a cloud of dust, stopping everything. Overall is was an amazing experience and a fantastic road trip. Everyone we spoke to was very friendly and there was a great atmosphere at the Ring and in the surrounding area too – a real haven for petrol heads. Planning the next visit now.', 'Car on Nürburgring', '', '', 'jpg', '1'),
(19, 1, 1, 3, '2007-08-14 17:11:32', '2007-08-14 17:11:32', 'Seriously Easy Going', 'seriously-easy-going/', 'Monkey Forest at Trentham in Staffordshire.', 'At [Monkey Forest](http://www.monkey-forest.com), Barbary Macaques roam freely in the beautiful, 60-acre, Trentham Estate woodland. Home for 140 Macaques, Monkey Forest (and three sister parks) is committed to the protection of the species, successfully re-introducing 600 into the Atlas Mountain, Morocco.\r\n\r\nBaby [Barbary Macaques](http://en.wikipedia.org/wiki/Barbary_Macaque), no more then a few days old, played at our feet - no bars, no cages. It\'s the relaxed atmosphere of the monkeys that strikes you. The way it should be.', 'Two Macaque Monkeys', '', '', 'jpg', '1'),
(20, 1, 1, 1, '2007-08-28 21:01:07', '2007-08-28 21:01:07', 'Do You Speak in Typography?', 'do-you-speak-in-typography/', 'A few videos showcasing how important typography is.', '**Typography is an absolute essential element in design**.\r\n\r\nRecently a few videos have surfaced which show off how important typography is. With little more than letters, the videos have been able to enhance, visualise and articulate favourite songs or movie quotes in an exciting and engaging fashion. Check out a few of my favourites:\r\n\r\n* [Say What Again](http://www.jarrattmoody.com/intonation.html) - an excerpt from Pulp Fiction (caution contains explicit language)\r\n* [Thank You For Smoking](http://shadowplaystudio.com/smoking.html) - the opening credits for a movie\r\n* [Ocean\'s Eleven Project](http://youtube.com/watch?v=rIDdx7NPJgo) - an excerpt from Ocean\'s Eleven\r\n* [Streetlight Manifesto](http://youtube.com/watch?v=OoCHFQ1rVpE) - an excerpt from a song\r\n* [Duck and Cover](http://youtube.com/watch?v=IEVvEsEbl5I) - from a 1950s public service announcement\r\n\r\nYou can find other videos I\'ve bookmarked on my [Typography video playlist](http://youtube.com/view_play_list?p=901D6D71A639DA3B) on YouTube.', 'Screenshot from \'Say What Again\' video\r\n', '', '', 'jpg', '1'),
(21, 1, 1, 4, '2007-09-10 17:10:02', '2007-09-10 17:10:02', 'Renault World Series', 'renault-world-series/', 'A great day watching Renault cars driving around Donington Park.', 'As we enter [Donington Park](http://www.donington-park.co.uk) the noise from the Formula Renault 3.5 (F1 feeder series) is ear splitting. The combination of noise and speed is intoxicating. Great racing (Formula Renault 3.5/UK, Megane racers, Clio Cups), loads of incidents / accidents and some great aerial displays including the [Red Arrows](http://en.wikipedia.org/wiki/Red_Arrows). Last seasons R26 F1 car did some flying laps and a launch-control start, plus a whole host of other motor sport exotica lapped in fury. There was loads to do and best of all [entrance was completely free](http://www.worldseriesbyrenault.com/donington/uk/)!', 'Formula Renualt and Renualt Megane Race Cars', '', '', 'jpg', '1'),
(22, 1, 1, 3, '2007-09-10 20:28:16', '2007-09-10 20:28:16', 'Trust Me', 'trust-me/', 'A free weekend courtesy of The National Trust.', 'This weekend it was [The National Trust](http://www.nationaltrust.org.uk/main/w-index.htm) \'Open Day\' and if you are interested in the conservation and heritage of our great nation there are many beautiful natural and historic environments to explore - for free! I took the family to [Attingham Park](http://www.nationaltrust.org.uk/main/w-vh/w-visits/w-findaplace/w-attinghampark.htm), Shrewsbury and had a fantastic day. Of course make sure you return on a paying day or they won\'t be here long enough for us to enjoy. \r\n\r\nI would rather have gone to [Renault World Series](/company/rich-rees/2007/09/10/renault-world-series/ \'Renault World Series hot topic\') at Donington Park but at least my wife and kids are still talking to me - unlike Rich.', 'Attingham Park', '', '', 'jpg', '1'),
(23, 1, 1, 1, '2007-09-10 20:51:40', '2007-09-21 21:17:10', 'Naming Ceremony', 'naming-ceremony', 'James Christopher Brewer at his naming ceremony.', 'This Sunday brought back friends and family from all over the country, just over twelve months since the wedding of my sister to Paul Brewer. This time it was to celebrate the naming of their first son; James Christopher Brewer.\r\n\r\nA good time was had by many and we all wish ‘Digger’ all the best.', 'James Christopher Brewer', '', '', 'jpg', '1'),
(26, 1, 1, 1, '2007-09-21 17:14:48', '2007-09-24 14:00:26', 'Nokia N95', 'nokia-n95', 'A mini-review of my new phone, a Nokia N95.', 'I finally upgraded my mobile phone to a [Nokia N95](http://www.nseries.com/products/n95/index.html).\r\n\r\nThis is now my fifth Nokia in a row. I have progressed many iterations including one with a qwerty keyboard (6800), a 6600 and the phone I\'ve just replaced is a 6680. Each time the phone has functioned extremely well and I\'ve never had one break (yet).\r\n\r\nIt has an amazing amount of features including Wi-Fi, a five mega-pixel camera and GPS. I\'m really looking forward to using all the data and creating a web interface to browse the information. Stay tuned…', 'Nokia N95', '', '', 'jpg', '1'),
(24, 1, 1, 2, '2007-09-11 13:33:46', '2007-09-11 13:33:46', 'Bangers to Budapest', 'bangers-to-budapest/', 'A trip across Europe to Budapest in my Z4.', 'From 20th to 29th September I\'m off with my wife and 60 others on road trip across Europe to Budapest. We will be driving through and staying in France, Germany, Austria, Slovenia and Hungary. The original idea was to buy a banger, drive it to Budapest, scrap it and fly home afterwards. As it happens there are a mix of bangers, classic cars, sports cars and even an ambulance going – some people intend to bring their cars back. I\'m taking my Z4 and flying back for the Great North Run on Sunday 30th – that is if all goes to plan!', 'The River at Budapest', '', '', 'jpg', '1'),
(25, 1, 1, 1, '2007-09-13 19:36:06', '2007-09-13 19:36:06', 'Run, Fatboy, Run', 'run-fatboy-run/', 'A mini-review of Run, Fatboy, Run, a British comedy.', 'David Schwimmer is at the helm in his theatrical directorial début, [Run, Fatboy, Run](http://www.runfatboyrunmovie.com): a story of love and perseverance but with a heavy twist of humour. The movie stars Simon Pegg as Dennis, the hapless protagonist yearning after his ex-fiancée, who he left pregnant at the altar five years ago! Now a washed-up, unfit (but not fat) security guard for a lingerie store, he is trying to win back the respect of his son and the love of his life.\r\n\r\nThis isn\'t the first time Simon Pegg and David Schwimmer have collaborated. They starred alongside one another in the overlooked heist-gone-wrong comedy of confusion and betrayal, Big Nothing. I highly recommend both [Big Nothing](http://www.bignothing.co.uk) and Run, Fatboy, Run if you\'re a fan of British humour and sarcasm.', 'Run, Fatboy, Run Movie Poster', '', 'http://www.runfatboyrunmovie.com', 'jpg', '1'),
(27, 1, 1, 1, '2007-09-25 10:42:39', '2007-09-25 10:42:39', 'Raindance Film Festival', 'raindance-film-festival', 'Information about the 15th Raindance Film Festival.', 'Today sees the start of the 15th annual [Raindance Film Festival](http://www.raindance.co.uk). The event is dedicated to promoting independent movies, from low or no budget productions to indie blockbusters.\r\n\r\nThe festival features upcoming movies as well as a range of [courses](http://www.raindance.co.uk/site/index.php?aid=10) for budding filmmakers who want to write, produce or direct their own film.\r\n\r\nThe festival is on in London until the 7th of October, so if you\'re interested in film and in the area I recommend checking it out.', 'Raindance Film Festival', 'Write, Produce, Direct Film', 'http://www.raindance.co.uk', 'jpg', '1'),
(28, 1, 1, 1, '2007-10-24 11:32:23', '2007-10-24 13:15:11', 'After Dark Film Festival', 'after-dark-film-festival/', '7 amazing nights of new horror and fantasy cinema', '[Toronto After Dark Film Festival](http://www.torontoafterdark.com) showcases thrilling international cinema, and runs annually during the week before Halloween.\r\n\r\nThe frightening film festival features a diverse selection of feature film premieres and innovative short films in the genre of horror, sci-fi, and fantasy.\r\n\r\nLast year there was the JHorror film Reincarnation – going on the standard from last year, this years films should be good as well. If you\'re a horror fan you should definitely pick them up on DVD when they\'re released.\r\n\r\nUnfortunately I do not live anywhere near Toronto else I would have definitely attended.', 'Toronto After Dark Film Festival Logo', '', 'http://www.torontoafterdark.com', 'gif', '1'),
(29, 2, 2, 2, '2007-10-03 10:54:45', '2007-10-03 16:32:45', 'Great North Run', 'great-north-run', 'We did it!', 'Well, my Brother and I did it! 13.1 miles of the Great North Run in 2 hours and 20 minutes. A bit slower than we would have liked, but what an experience. \r\n\r\nEmotions ran high throughout the run and we both enjoyed the atmosphere and the company of all the other runners. \r\n\r\nThanks to everyone who kindly sponsored us, we raised almost £800 for the NSPCC. \r\n\r\nI would also like to congratulate all those special people out there who completed the run and raised money for other good causes. Well done everyone!', 'Leigh and Lloyd at the start', 'Before the off', '', 'jpg', '1'),
(30, 3, 3, 3, '2007-10-03 13:26:22', '2007-10-03 17:33:40', 'Living Legend', 'living-legend', 'Ian Davy\'s 39th Birthday - 5th October 2007', 'They say you can judge a man by his friends - well having a friend like Dave is a sure-fire way of dragging your average score up. My longest standing mate from 4th year Geography, and some 25 years on we will be celebrating his 39th Birthday this weekend. This guy is real Swiss Army Knife of a friend - he even a bloody good cook, God damn it!\r\n\r\nOf course just knowing a legend doesn\'t make you one yourself - I\'ve got a long way to go but as long as Martin, Leigh, Rich and Dave don\'t turn into mass murders I think I\'ve got this sewn up.\r\n\r\nHappy Birthday dude!\r\n\r\n\r\nP.S. Alison says *\"every super hero has his nemesis - Superman has Kryptonite, Ian\'s is a vacuum cleaner.\"*', 'Dave (Ian to his family)', '', '', 'jpg', '1'),
(31, 1, 1, 1, '2007-10-04 11:48:10', '2007-10-04 15:00:55', 'Top Gear is Back!', 'top-gear-is-back', 'BBC\'s motorshow is finally back on TV', '[Top Gear](http://www.bbc.co.uk/topgear/), everyone\'s favourite petrol-fueled TV show, is back on the BBC this Sunday (7th October). Hang out with Clarkson, Hammond and Captain Slow for a ten-week run of the best car show on earth.\r\n\r\nThey\'ll be trans-country challenges (hopefully), stupidly expensive super-cars, celebrities in a reasonably priced car, the Stig racing around the track and no doubt plenty of non-PC jokes, especially about the Germans.\r\n\r\nTune in at **8pm on Sundays** or catch the repeats on Wednesdays at 7pm.', 'Top Gear Logo', '', 'http://www.bbc.co.uk/topgear/', 'gif', '1'),
(32, 1, 1, 1, '2007-10-15 11:01:18', '2007-10-15 12:31:00', 'Last.fm', 'lastfm/', 'The social music revolution', '[Last.fm](http://www.last.fm) is \"the social music revolution\". Simply listen to music on your computer or iPod and Last.fm will save your playlists. Every song you listen to will become part of your music profile.\r\n\r\nOnce you\'ve uploaded a few tracks, you can start enjoying all the features, including:\r\n\r\n* Automatically create personal music charts and radio station.\r\n* Discover, explore and listen to new music.\r\n* See what your friends are listening to.\r\n\r\nBecause Last.fm is a passive social website, all you need to do is create an account and listen to your music. The main idea of the website is to record your listening habits, but there is also a nice social aspect to the website. You can engage with users who listen to similar music and browse for new music based on your taste and listening habits of others.', 'Last.fm', 'Last.fm – the social music revolution', 'http://www.last.fm', 'gif', '1'),
(33, 3, 1, 3, '2007-10-08 09:29:04', '2007-10-08 11:13:40', 'Top Gear \'till Christmas!', 'top-gear-till-christmas', 'Sunday sees the return of Top Gear. Oh yes and it runs until Christams which is only 10 weeks away!', 'Getting the kids to bed without breaching the 8 o\'clock deadline has become ever more stressful with the return of Clarkson, Hammond and the polite one with sympathetic hair in BBC2\'s Top Gear - Sunday 8pm.\r\n\r\nWhile there are still oil reserves man will endeavour to construct evermore creative ways of depleting supplies all in the name of entertainment. In episode one we see Lamborghini, Porsche, Aston Martin and Volkswagen none the less, doing their utmost to raise sea levels - fantastic!\r\n\r\nBit worrying to think I\'ll be Christmas wrapping before the series ends in December.', 'Golf GTi - W12', 'Golf GTi - W12. Just shows that power is nothing without handling.', '', 'jpg', '1'),
(34, 1, 1, 1, '2007-10-31 14:49:41', '2007-10-31 15:28:52', 'The Multipack', 'the-multipack/', 'A community of web and design orientated individuals from the Midlands, UK.', '[The Multipack](http://www.multipack.co.uk) is a community of multi-talented individuals from across the Midlands UK, that come together to discuss all the things web and share their knowledge, skills and talents.\r\n\r\nThe group has just entered its third year, meeting up regularly once a month at different locations across the region – although usually ending up in Birmingham.\r\n\r\nHaving been a member from (almost) the start I can say it\'s a great opportunity to meet like minded developers, designers and perhaps even the odd expert! It\'s a great place to talk about websites, conferences and the latest gadgets, make friends, colleagues and even find new and *exciting* job prospects.\r\n\r\nCome along and share your ideas and perhaps learn something new.', 'The Multipack Logo', '', 'http://www.multipack.co.uk', 'gif', '1'),
(35, 1, 1, 1, '2007-10-22 11:47:24', '2007-10-22 12:14:25', 'Flickr', 'flickr/', 'Online photo management and sharing application.', '[Flickr](http://www.flickr.com) is a photo sharing website, based around a great community. The basic idea is you upload your photos and share them with the world. But there are so many other great features and reaons to use Flickr.\r\n\r\nThere is a great community spirit around Flickr and it\'s great to browse the huge range of photos and participate in their comments. There are groups you can join for a whole host of differing topics – enough to suit anyone (and more!).\r\n\r\nYou can restrict your photos for friends and family, tag them for easy grouping, put them in sets and those within groups and even add the geo-location information. The data associated with your photos is huge and all available using Flickr\'s brilliant API.\r\n\r\nI implore you to [explore](http://flickr.com/explore/) all the [interesting photos](http://www.flickr.com/explore/interesting/7days/ \'Most interesting photos from the last 7 days...\') for some [spectacular](http://www.flickr.com/photos/tags/spectacular/interesting/ \'Most interesting photos tagged with \"spectacular\"\') shots\r\n\r\n[Sign up](http://www.flickr.com/signup/) and try, because best of all it\'s free!', 'Flickr Logo', '', 'http://www.flickr.com', 'gif', '1'),
(36, 1, 1, 1, '2007-10-16 11:58:09', '2007-11-08 19:45:56', 'Twitter', 'twitter/', 'What are you doing?', '[Twitter](http://twitter.com) is a strange concept to grasp, or at least it was for me. The website poses a simple question – **What are you doing?**', 'Twitter Logo', '', 'http://twitter.com/', 'gif', '0'),
(37, 3, 3, 3, '2007-11-19 14:06:27', '2007-11-19 14:35:05', 'The Mighty Boosh', 'the-mighty-boosh/', 'The Mighty Boosh are back with Series 3, Thursday\'s 10.30pm on BBC3.', 'If you regard The Young Ones, Black Adder and Red Dwarf as comedy classics, you have got to catch The Might Boosh, on Thursdays 10.30pm, BBC3.\n\nHoward Moon (Julian Barratt) and Vince Noir (Noel Fielding) are best, if not sometimes brutally mismatched and unwilling, friends working in a second hand shop and…\n\n…well words fail me beyond this point. you\'ve just got to watch it.', 'Vince Noir and Howard Moon - The Mighty Boosh', 'Vince Noir and Howard Moon - The Mighty Boosh', 'http://www.bbc.co.uk/comedy/mightyboosh/show_feature.shtml', 'jpg', '1'),
(38, 3, 3, 3, '2007-11-27 13:39:16', '2007-11-27 14:27:01', 'Valet Parking', 'valet-parking/', 'Continuing the theory of \'a happy designer is a creative designer\' Leigh has organised \'Valet Parking\' for the team.', 'There are many perks to working here at Creation\". The first and most obvious is the diverse range of first class clients, Pizza Wednesday, Pint and Peanuts Friday and GT4 on the PS2 any day of the week, to name a few.\r\n\r\nContinuing the theory of \'a happy designer is a creative designer\' Leigh has organised \'Valet Parking\' for the team. OK it isn\'t valet parking in it\'s purest sense. You have to park your own car but when you leave at the end of the day your car has been valeted inside and out - how cool is that?\r\n\r\nSo thanks to Leigh for organising that for us. We now know the answer to the life long question - \'what colour is Trev\'s car?\'. I can formally announce that it is metallic light blue!', 'Creation team cars - waxed and polished', 'Creation team cars - waxed and polished', 'http://www.penkridgevaleting.co.uk/', 'jpg', '1'),
(39, 1, 1, 1, '2007-12-07 09:41:50', '2007-12-07 09:58:25', '24 Ways', '24-ways/', 'A advent calendar for geeks.', '24 Ways is an [advent calendar for geeks](http://24ways.org). This is the third year in a row that [Drew McLellan](http://allinthehead.com) has set up this fantastic resource for web developers and designers.\r\n\r\nEvery day, for twenty-four days, leading up to Christmas [24 Ways](http://24ways.org) features articles for anyone interested in web standards and web development.\r\n\r\nAll your favourite web developers from across the globe chime in with their favourite techniques and tricks which will help you improve your web development skills. Definitely worth reading.', '24 Ways to impress your friends', '', 'http://24ways.org', 'gif', '1'),
(40, 1, 1, 1, '2007-12-10 09:56:07', '2007-12-10 10:45:48', 'Tumblr', 'tumblr/', 'Publish your thoughts and ideas on the web.', '[Tumblr](http://www.tumblr.com) is a free and extremely easy way for you to publish your thoughts and ideas on the web. Tumblr is a variation of a blog – a tumblelog infact.\r\n\r\n> [tumblelogs] favor short-form, mixed-media posts over the longer editorial posts frequently associated with blogging. Common post formats found on tumblelogs include links, photos, quotes, dialogues, and video. Unlike blogs, this format is frequently used to share the author\'s creations, discoveries, or experiences without providing a commentary.\r\n\r\n[Tumblr](http://www.tumblr.com) is effortless to setup and start using. I\'ve been posting on [my tumblr](http://trovster.tumblr.com \"trovster on tumblr\") account for a few weeks now and it\'s incredibly easy which helps you contribute and keep up the flow of updating.\r\n\r\nSetup your own account and start saving all those cool links, fun photographs and crazy quotes to one place and share them with your friends.', 'Tumblr Logo', '', 'http://www.tumblr.com', 'gif', '1'),
(42, 1, 1, 1, '2008-01-01 13:19:22', '2008-01-01 17:58:44', 'The Best of 2007', 'the-best-of-2007/', 'A list of my favourite songs, albums and movies from 2007', 'Here are my favourite songs, albums and movies which were released (in the UK) in 2007.\r\n\r\n####Songs####\r\n\r\n1. The Starting Line – Something Left to Give (Direction)\r\n2. Relient K – Deathbed (Five Score and Seven Years Ago)\r\n3. Mayday Parade – Miserable At Best (A Lesson In Romantics)\r\n4. Motion City Soundtrack – The Conversation (Even If It Kills Me)\r\n5. Yellowcard – Dear Bobbie (Paper Walls)\r\n\r\n####Albums####\r\n\r\n1. Motion City Soundtrack – Even If It Kills Me\r\n2. Yellowcard – Paper Walls\r\n3. The Starting Line – Direction\r\n4. Fall Out Boy – Infinity on High\r\n5. Mayday Parade – A Lesson In Romantics\r\n\r\n(Honourable mentions include Eleventyseven, Mae, Relient K & The Operation MD)\r\n\r\n####Movies####\r\n\r\n1. [The Assassination of Jesse James by the Coward Robert Ford](http://www.imdb.com/title/tt0443680/)\r\n2. [The Lives of Others](http://www.imdb.com/title/tt0405094/)\r\n3. [Ratatouille](http://www.imdb.com/title/tt0382932/)\r\n4. [The Fountain](http://www.imdb.com/title/tt0414993/)\r\n5. [Alpha Dog](http://www.imdb.com/title/tt0426883/)\r\n\r\n(Honourable mentions include American Gangster, Hot Fuzz, Zodiac, 3:10 to Yuma & Planet Terror)', '', '', '', '', '1'),
(41, 1, 1, 1, '2007-12-17 09:27:49', '2007-12-17 10:20:51', 'RotateMe', 'rotateme/', 'RotateMe is an application for your symbian mobile phone to change the screen orientation.', '[RotateMe](http://www.bysamir.fr/rotateme/) is an application for your symbian mobile phone to change the screen orientation.\r\n\r\nIf you\'ve got a Nokia N95 ([like me](/company/trevor-morris/2007/09/21/nokia-n95/)) then you can use this application to change the screen orientation automagically. Simply install the Nokia accelerometer application, then [RotateMe](http://www.bysamir.fr/rotateme/) and it should all work as expected.\r\n\r\nNow when your friend shows off their iPhone doing this little trick, you can show them yours!', 'RotateMe – two arrows logo', '', 'http://www.bysamir.fr/rotateme/', 'gif', '1'),
(43, 2, 2, 2, '2008-01-10 14:55:08', '2008-01-10 14:55:08', 'Green laning', 'green-laning/', 'XR400 for green laning', 'This is my XR400 bought at the end of last year and picked up last weekend. When it has an MOT and tax I will be out this year having fun. \r\n\r\nIt is an Enduro bike which means it is primarily an off road bike but with road gear to allow you to use it on our highways. Green laning is a way of riding on off road surfaces but legally. There are many roads up and down the country which, although classed as highway, are muddy tracks. These are what we will be hunting out. I will keep a tally of the bruises for you.', 'Honda XR400', '', '', 'jpg', '1'),
(44, 1, 1, 1, '2008-01-07 13:10:21', '2008-01-10 15:17:44', 'Helvetica – A Review', 'helvetica-a-review/', 'A mini-review of Helvetica, a documentary film about the typeface.', '[Helvetica](http://www.helveticafilm.com) was a good introduction in to the most important typeface in todays society. The film follows the timeline of the font, from it\'s inception 50 years ago, through a rebellion period and emerging as the \'defecto\' font in everyday society.\r\n\r\nI felt some parts of the film put too much emphasis on the importance of the font in relation to politics and commercialism – even relating the font to the Vietnam war and the current invasion of Iraq. However, the segments by [Erik Spiekermann](http://www.spiekermann.com), [Experimental Jetset](http://www.experimentaljetset.nl) and [Michael C. Place](http://wearebuild.com) were interesting and educational without being pretentious.\r\n\r\nThe film is well shot and the cinematography of the stills which artfully reveal the use of the font all around us are beautiful.', 'Helvetica Movie Poster', '', 'http://www.helveticafilm.com', 'jpg', '1'),
(45, 5, 5, 5, '2008-01-11 09:43:42', '2008-01-11 09:50:18', 'Kennedy Space Centre', 'kennedy-space-centre/', 'My visit to Kennedy Space Centre', 'In November 2007 I visited Florida for a holiday with my partner and children. During our holiday we visited the Kennedy Space Centre.  It was a fantastic day, the space centre has so many attractions to see and experience, one day is not enough.\r\n\r\nThe best part was watching the work force building the space station. You find it hard to believe the parts you see being made will soon be floating around in space for many years.  \r\nSeeing the Space Shuttle ready for launch was also very exciting, it may have been a few miles away but still breathtaking.', 'Apollo Saturn V', '', '', 'jpg', '1'),
(46, 1, 1, 1, '2008-01-17 14:44:09', '2008-01-22 16:24:18', 'Sundance Film Festival', 'sundance-film-festival/', 'Ten days of the best upcoming movies of 2008.', 'The [Sundance Film Festival](http://www.sundance.org/festival/) is probably the most well-known indie film festival. A huge amount of brilliant films have been widely distributed since their debut at this festival. In 2006 alone the following great films had their premiere; Alpha Dog, Little Miss Sunshine and Lucky Number Slevin and other modern cult classics such as The Butterfly Effect, 28 Days Later, Memento & Donnie Darko were selected in previous years.\r\n\r\nThis year sees the premieres of a lot of films I am looking forward to, including; Be Kind Rewind, In Bruges and [Funny Games](http://www.imdb.com/title/tt0808279/) – the American shot-by-shot remake by Michael Haneke, who also directed the original German language release in 1997.\r\n\r\nAgain, because the festival takes place on foreign climes (more specifically the state of Utah, USA), I have been unable to attend yet. However, I would love to attend this event one year.', 'Sundance 2008 Film Festival logo', '', '', 'jpg', '1'),
(47, 1, 1, 1, '2008-01-22 17:23:38', '2008-01-22 17:40:53', 'Best Director Oscar Nominations', 'best-director-oscar-nominations/', 'My thoughts on the Best Director nominations for 2008\'s Oscars.', '[Nominations](http://www.oscars.org/80academyawards/nominees/announcement.html) for the most prestigious film awards - the Academy Awards - have been announced. Here are my thoughts on the [this years Oscar](http://www.oscars.org/80academyawards/index.html) nominations for *Best Director*.\r\n\r\nI\'ve only been able to see one of these films so far; Michael Clayton. Although the film was well shot and acted, I thought pacing and storytelling were slow and confusing. Juno has been raved about, but I don\'t see it pushing any directorial boundaries. The Coen-Brothers are supposedly back on top form for \"No Country for Old Men\" and \"There Will Be Blood\" will no doubt be an epic like his previous films \"Magnolia\" and \"Boogie Nights\". It\'ll be a tough call between these two veteran filmmakers.\r\n\r\nHowever, I am most looking forward in seeing \"[The Diving Bell and the Butterfly](http://www.imdb.com/title/tt0401383/)\". The French film about the true story of Elle editor Jean-Dominique Bauby who suffers a stroke and has to live with an almost totally paralyzed body; has been [reviewed](http://www.cinematical.com/2007/12/21/cannes-review-le-scaphandre-et-le-papillon/ \'The Diving Bell and the Butterfly review by James Rocchi at Cinematical\') as \"imagine a Spike Jonze-Charlie Kauffman-Michel Gondry-style film\" — I envisage a rewarding masterpiece.', 'A group of Oscar award statues', '', 'http://www.oscars.org', 'jpg', '1'),
(48, 3, 3, 3, '2008-01-31 11:19:08', '2008-01-31 11:23:41', 'Stop raining - pleeeeeease!', 'stop-raining-pleeeeeease/', 'A plea to anyone who can help it stop raining.', ': (', 'Rain on my window', 'Rain on my window', '', 'jpg', '1'),
(49, 4, 4, 4, '2008-02-14 12:26:19', '2008-02-14 12:26:19', 'Valentines Day', 'valentines-day/', 'Happy Valentines Day gorgeous!', 'Happy Valentines Day gorgeous!', 'Red Rose', 'Red Rose', '', 'jpg', '1'),
(50, 3, 3, 3, '2008-02-15 12:57:19', '2008-02-15 13:00:37', 'Happy Birthday Eden!', 'happy-birthday-eden/', 'Eden is 6 on 24th February 2008', 'The world is a better place with you in it.', 'Eden 6yrs', 'Eden 6yrs', '', 'jpg', '1'),
(51, 1, 1, 1, '2008-02-26 11:15:27', '2008-02-27 20:46:33', 'Be Kind Rewind', 'be-kind-rewind/', 'A new movie by Michel Gondry about two men set out to remake classic films.', '> You name it, we shoot it.\r\n\r\n[Be Kind Rewind](http://www.imdb.com/title/tt0799934/) is the new movie by Michel Gondry in a story which follows two friends who \'faithfully\' recreate famous movies when one of them unintentionally destroys every tape in a video store because he\'s magnetized. Their movies are only ten minutes long and visualised with a non-existant budget, but have a certain love-affair by the people who watch them.\r\n\r\nMichel Gondry has unique and interesting ways of creating films and although the Be Kind Rewind attempts this, it misses the mark by a long shot. The consequence is this means a very poor film by any standard – let alone the mantle I have placed Gondry upon.\r\n\r\nI *really* wanted to enjoy Be Kind Rewind. I couldn\'t. Gondry also directed the brilliant [Eternal Sunshine of the Spotless Mind](http://www.imdb.com/title/tt0338013/) starring Jim Carrey and Kate Winslet and I cannot recommend this movie enough.\r\n\r\nIf you\'re looking for a masterpiece by Gondry look no further than Eternal Sunshine, however if you\'re looking for a \'movie with heart\' (as Be Kind Rewind\'s remake ethos is) and you don\'t mind foreign films, check out the dreamworld of cardboard and cellophane in the French speaking [Science of Sleep](http://www.imdb.com/title/tt0354899/).\r\n\r\nI am sad to say I can not recommend this movie.', 'Be Kind Rewind Poster', '', 'http://www.imdb.com/title/tt0799934/', 'jpg', '1'),
(52, 1, 1, 1, '2008-02-20 11:42:48', '2008-02-20 12:27:50', 'Juno', 'juno/', 'A mini-review of Juno, an indie hit taking the box office by storm.', '[Juno](http://www.imdb.com/title/tt0467406/) has been touted as the best \'indie\' movie since [Little Miss Sunshine](http://www.imdb.com/title/tt0449059/) and the amazing box office success has confirmed this.\r\n\r\nJuno is a young girl who has found herself in the ultimate caper; being a pregnant teenager at high-school.\r\n\r\nThe movie deals with issues such as teenage pregnancy, high-school dymanics and adaoption all in an extremely quirky, witty yet intelligent way. The acting is pretty much flawless and every line is poetically crafted and delivered. I think this movie requires multiple viewings to fully appreciate everything on offer due to the subtly, cleverness, quirkiness and multiple-levels of the humour.\r\n\r\nI have seen this movie twice and both times I loved it – I could even watch it again. This is a hallmalk of a remarkable movie which is exactly what Juno is.\r\n\r\nI hope Juno will win the Oscar for \"Best Original Screenplay\" this year just like Little Miss Sunshine did in 2007.\r\n\r\nYou should go see this movie. **Ten out of ten**.', 'Juno Poster', '', 'http://www.imdb.com/title/tt0467406/', 'jpg', '1'),
(53, 1, 1, 1, '2008-03-06 18:09:54', '2008-03-06 18:12:55', 'Goodbye', 'goodbye/', 'A farewell to my feline friend', 'This is a simple farewell to my favourite feline friend. Goodbye.', 'Tigger', '', '', 'jpg', '1'),
(54, 1, 1, 1, '2008-03-28 15:13:01', '2008-03-28 15:44:01', 'BTCC 2008', 'btcc-2008/', 'Start of the British Touring Car Championship for 2008', 'This weekend sees the start of the 2008 [British Touring Car Championship](http://www.btcc.net). Sunday 30th March sees the motorsport return for it\'s fifteenth season, with the opening round taking place at Brands Hatch in Kent.\r\n\r\nLast years title race was incredibly close, with the entire championship being decided on the final race of season. Jason Plato racing for Seat led for most of the season but was pipped to the post by Fabrizio Giovanardi driving a Vauxhall Vectra.\r\n\r\nThis year I\'ll be supporting **Jason Plato** again. And hopefully I\'ll get the [chance to go see the action live again](/company/trevor-morris/2007/07/16/btcc-at-donington/).', 'BTCC 2008', '', 'http://www.btcc.net', 'jpg', '1'),
(55, 1, 1, 1, '2008-04-24 10:31:30', '2008-04-24 11:48:05', 'Synergy', 'synergy/', 'Lets you share a mouse and keyboard between computers.', '[Synergy](http://synergy2.sourceforge.net) is an awesome little utility available for Windows, Mac OSX  and Unix which allows you to easily share one set of mouse and keyboard across multiple computers.\r\n\r\nI have been using Synergy for a couple of months now and I really do not know how I worked without it. Moving from Windows across to OSX is simple and quick. You can even copy text from one to the other.\r\n\r\nAn absolutely brilliant application. If you are using more than one machine on your desk at any time, you must install this application. Seriously, you\'ll wonder how you ever lived without it!', 'Synergy icon', '', 'http://synergy2.sourceforge.net', 'jpg', '1'),
(56, 1, 1, 1, '2008-05-19 09:16:19', '2008-05-19 09:29:35', 'Geek in the Park 2008', 'geek-in-the-park-2008/', 'Geeks return to Leamington Spa for picnic and web discussions.', 'I have just launched the 2008 website for [Geek in the Park](http://www.geekinthepark.co.uk). After a year break, the event is back, featuring a picnic during the day, followed by industry leading speakers in the evening.\r\n\r\nAt the moment some of the finer details are yet to be confirmed. If you sign up to the newsletter you will be kept up to date with all the details when they\'re announced and be reminded a week before the event.\r\n\r\nHopefully the weather will be as good as in [2006](http://2006.geekinthepark.co.uk) and you\'ll be able to join [The Multipack](http://www.multipack.co.uk) for a quick game of footie.', 'Geek in the Park 2008 Logo', '', 'http://www.geekinthepark.co.uk', 'jpg', '1');
