(1, 1, 1, '2007-06-22 14:50:49', '2007-06-22 14:50:49', '2007-06-22 14:50:49', 'Explore', 'explore/', 'Hello  [firstname,fallback=customer].\r\n\r\nOur exciting new website is live and we want you to get involved! Take a look. http://www.creation.uk.com\r\n\r\nNew News - Your opinion is welcome in our news section, where current topics are up for discussion - let us know what you think, but keep it clean!\r\n\r\nNew Services - What more can we do for you? In addition to our extensive range of services we have developed a full range of \'fixed price\' design packages and solutions to help you get more from your marketing budget - whether consultancy, print, websites, branding, advertising or display we have a solution for you.\r\n\r\nNew Portfolio - See who has been keeping us busy in our dynamic new portfolio. Take a look at what we have done for other clients, you might find something that inspires your next project. So keep dropping in – new projects are continually being added.\r\n\r\nIf you would like to talk about any of our services or any projects you have in mind, you can email leigh@creation.uk.com or call +44 (0)1785 716136.\r\n\r\nSimply Explore. Your involvement is valuable to us.', '####Hello  [firstname,fallback=customer].####\r\n\r\n####**Our exciting new website is live and we want you to get involved! Take a look. [www.creation.uk.com](http://www.creation.uk.com)**####\r\n\r\n***New [News](/news/)*** - Your opinion is welcome in our news section, where current topics are up for discussion - let us know what you think, but keep it clean!\r\n\r\n***New [Services](/services/)*** - What more can we do for you? In addition to our extensive range of services we have developed a full range of \'fixed price\' design packages and solutions to help you get more from your marketing budget - whether [consultancy](/services/consultancy/), [print](/services/print/), [websites](/services/websites/), [branding](/services/branding/), [advertising](/services/advertising/) or [display](/services/display/) we have a solution for you.\r\n\r\n***New [Portfolio](/portfolio/)*** - See who has been keeping us busy in our dynamic new portfolio. Take a look at what we have done for other clients, you might find something that inspires your next project. So keep dropping in – new projects are continually being added.\r\n\r\nIf you would like to talk about any of our services or any projects you have in mind, you can email [leigh@creation.uk.com](mailto:leigh@creation.uk.com) or call **+44 (0)1785 716136**.\r\n\r\n*Simply **[Explore](http://www.creation.uk.com)**. Your involvement is valuable to us.*', 'Our exciting new website is live and we want you to get involved! Take a look.', '1', '0'),
(2, 1, 1, '2007-11-04 09:29:47', '2007-11-04 09:29:47', '2007-11-04 09:29:47', 'Your Perspective', 'your-perspective/', 'Hello [firstname,fallback=customer],\r\n\r\nOur aim is to create websites that are dynamic and functional – we need your feedback to help us achieve this.\r\n\r\nPlease take this opportunity to rate your website by completing our short online survey. Your suggestions will help us to improve our products and services in the future.\r\n\r\nTake a look at the survey and tell us what you think! http:///www.creation.uk.com/feedback/your-perspective/\r\n\r\nConducting your own online survey may generate ways of improving your services too. So if you don\'t have time to complete ours, please just take a look at how it works and get in touch to find out more.', '####Hello [firstname],####\r\n\r\n####**Our aim is to create websites that are dynamic and functional – we need your feedback to help us achieve this.**####\r\n\r\nPlease take this opportunity to rate your website by completing our short online survey. Your suggestions will help us to improve our products and services in the future.\r\n\r\n[Take a look at the survey and tell us what you think!](http:///www.creation.uk.com/feedback/your-perspective/)\r\n\r\n**[Take the survey](http:///www.creation.uk.com/feedback/your-perspective/)**\r\n\r\nConducting your own online survey may generate ways of improving your services too. So if you don\'t have time to complete ours, please just take a look at how it works and get in touch to find out more.', 'Please take this opportunity to rate your website by completing our short online survey.', '1', '0'),
(3, 1, 1, '2007-11-06 17:09:42', '2007-11-06 17:09:42', '2007-11-06 17:09:42', 'Christmas e-shot Offer!', 'christmas-eshot-offer/', 'Hello [firstname,fallback=customer],\r\n\r\nIt\'s not too late to send your clients a personalised Christmas message for only £197 - it couldn\'t be easier!\r\n\r\nJust choose your preferred Christmas e-shot option, send us your personalised message (max 200 words), your logo if required and a list of recipients (price includes up to 500 addresses) as a Microsoft Excel file - /files/eshot-campaign-import-example.xls - and your e-shot will be delivered on the date you specify!\r\n\r\nStylish, cost effective, quick and easy!\r\n\r\nAn excellent way to advertise your Christmas opening times!\r\n\r\n* Option 1 - /files/eshots/christmas/christmas-blue.html\r\n* Option 2 - /files/eshots/christmas/christmas-red.html\r\n* Option 3 - /files/eshots/christmas/christmas-green.html\r\n\r\n*Downloadable sample Excel file\r\n\r\nSave hundreds of pounds with a Christmas e-shot for only £197, Call: 01785 716 136 or email: leigh@creation.uk.com\r\n\r\nAsk about our fully tailored Christmas e-shots from £595.', '####Hello [firstname,fallback=customer],####\r\n\r\n####**It\'s not too late to send your clients a personalised Christmas message for only £197 - it couldn\'t be easier!**####\r\n\r\nJust choose your preferred Christmas e-shot option, send us your personalised message (max 200 words), your logo if required and a list of recipients (price includes up to 500 addresses) as a [Microsoft Excel file](/files/eshot-campaign-import-example.xls) and your e-shot will be delivered on the date you specify!\r\n\r\n**Stylish, cost effective, quick and easy!**\r\n\r\n*An excellent way to advertise your Christmas opening times!*\r\n\r\n* [![Option One](/images/eshots/3_merry-christmas-option-one.jpg \'Option One\') *View Option One...*](/files/eshots/christmas/christmas-blue.html)\r\n* [![Option Two](/images/eshots/3_merry-christmas-option-two.jpg \'Option Two\') *View Option Two...*](/files/eshots/christmas/christmas-red.html)\r\n* [![Option Three](/images/eshots/3_merry-christmas-option-three.jpg \'Option Three\') *View Option Three...*](/files/eshots/christmas/christmas-green.html)\r\n\r\nSave hundreds of pounds with a Christmas e-shot for only **£197**, Call: 01785 716 136 or email: [leigh@creation.uk.com](mailto:leigh@creation.uk.com)\r\n\r\nAsk about our fully tailored Christmas e-shots from £595.', 'It\'s not too late to send your clients a personalised Christmas message for only £197.', '1', '0'),
(4, 1, 1, '2007-12-17 16:06:26', '2007-12-17 16:06:26', '2007-12-17 16:06:26', 'Merry Christmas', 'merry-christmas/', 'Hello [firstname,fallback=customer],\r\n\r\nWe would like to wish you a very Merry Christmas from everyone at Creation\r\n\r\nIt\'s been a pleasure doing business with you over the last year. Let\'s raise our glasses to a prosperous 2008.\r\n\r\nOur offices close at 5pm on Thursday 20th December 2007 and reopen on Thursday 3rd January 2008.\r\n\r\nWe look forward to working with you in the New Year\r\n\r\nWishing you a Merry Christmas and a Happy New Year', '####Hello [firstname],####\r\n\r\n####**We would like to wish you a very Merry Christmas from everyone at Creation**####\r\n\r\nIt\'s been a pleasure doing business with you over the last year. Let\'s raise our glasses to a prosperous 2008.\r\n\r\nOur offices close at 5pm on *Thursday 20th December 2007* and reopen on *Thursday 3rd January 2008*.\r\n\r\n**We look forward to working with you in the New Year**\r\n\r\nWishing you a Merry Christmas and a Happy New Year', 'We would like to wish you a very Merry Christmas from everyone at Creation.', '1', '0');
