INSERT INTO `feedback_question` (`ID`, `feedback_ID`, `Created`, `Updated`, `Question`, `Type`, `Position`, `Required`, `Active`) VALUES
(1, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How happy are you with the overall look and feel of your website?', 'rating', 2, '1', '1'),
(2, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How happy are you that the website complements your corporate brand image?', 'rating', 3, '1', '1'),
(3, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Generally how happy are you with comments you have received from other users of your site?', 'rating', 4, '1', '1'),
(4, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'With regard to the \'look\' of your website, what do you particularly like or dislike?', 'textarea', 5, '1', '1'),
(5, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How happy are you that the website fulfils your original requirements?', 'rating', 6, '1', '1'),
(6, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How happy are you with the ease at which you can edit your website in the admin area?', 'rating', 7, '1', '1'),
(7, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How successful are you with using \'Markdown\' to stylise text on your website?', 'rating', 8, '1', '1'),
(8, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How often do you expect to make changes to your site?', 'rating', 9, '1', '1'),
(9, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How happy are you that you understand all of the features of your site?', 'rating', 10, '1', '1'),
(10, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'With regard to the \'functionality\' your website, what do you particularly like or dislike?', 'textarea', 11, '1', '1'),
(11, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How good was your understanding of the original pricing and specification of the website?', 'rating', 12, '1', '1'),
(12, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How do you rate the \'value for money\' of your website?', 'rating', 13, '1', '1'),
(13, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How well has your website increased the growth or awareness of your company?', 'rating', 14, '1', '1'),
(14, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How do you rate Creation\'s after sales support?', 'rating', 15, '1', '1'),
(15, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'How interested are you in conducting your own online survey in the future?', 'rating', 16, '1', '1'),
(16, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'When dealing with Creation is there anything you particularly like or dislike?', 'textarea', 17, '1', '1'),
(17, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Which website package do you have?', 'select', 17, '1', '1');
