INSERT INTO `forms_feedback` (`ID`, `Created`, `IP`, `UA`, `Page`, `Subject`, `Message`, `Name`, `Email`, `Sent`, `Replied`, `Is_Spam`, `Via_AJAX`) VALUES
(1, '2007-06-07 10:19:55', '83.61.239.140', 'Mozilla/5.0 (Macintosh; U; PPC Mac OS X; en) AppleWebKit/312.1 (KHTML, like Gecko) Safari/312', '/contact/', 'long time', 'Hey guys.. long time, no see!\\r\\nI havent forgot your tees!! they are in production as we speak! When im next over in the uk (which should be august), ill drop in to say hello. ill bring the tees with me.\\r\\nLiking the new site! although.. not sure if the portfolio is working right? images are disappearing?\\r\\nanyway, hope all is going well. drop me an email tim.. tell me stories of people who dont know how to drive!! justin.', 'justin sola', 'sola@grafiksub.com', '1', '0', '0', '0'),
(2, '2007-06-07 11:45:46', '80.229.32.51', 'Mozilla/5.0 (Macintosh; U; PPC Mac OS X Mach-O; en-US; rv:1.8.1.4) Gecko/20070515 Firefox/2.0.0.4', '/contact/', 'test from the site', 'Well?', 'Leigh Scott', 'leigh@creation.uk.com', '1', '0', '0', '0'),
(3, '2007-06-07 12:14:30', '81.174.239.153', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; .NET CLR 2.0.50727; .NET CLR 1.1.4322; InfoPath.2; .NET CLR 3.0.04506.30)', '/contact/', 'The Website', 'That...is a mighty fine website.', 'Brian Roberts', 'brian@dblogic.co.uk', '1', '0', '0', '0'),
(4, '2007-06-07 12:46:55', '83.61.239.140', 'Mozilla/5.0 (Macintosh; U; PPC Mac OS X; en) AppleWebKit/312.1 (KHTML, like Gecko) Safari/312', '/contact/', 'long time', 'Hey guys.. long time, no see!\\r\\nI havent forgot your tees!! they are in production as we speak! When im next over in the uk (which should be august), ill drop in to say hello. ill bring the tees with me.\\r\\nLiking the new site! although.. not sure if the portfolio is working right? images are disappearing?\\r\\nanyway, hope all is going well. drop me an email tim.. tell me stories of people who dont know how to drive!! justin.', 'justin sola', 'sola@grafiksub.com', '1', '0', '0', '0'),
(5, '2007-06-07 16:38:02', '194.131.197.141', 'Opera/9.21 (Windows NT 5.1; U; en)', '/contact/', 'Typo', 'On the contact page you have a typo:\\r\\n\\\"What out for the speed cameras\\\"', 'Freexe', 'freexe@gmail.com', '1', '0', '0', '0'),
(6, '2007-06-08 05:00:34', '222.70.180.40', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1)', '/contact/', 'banner stand', 'Dear sir,	\\r\\n\\r\\nGlad to see you on google and hope we can establish a new trade relationship with you.\\r\\n\\r\\nWe are banner stands company and one of the best suppliers of china,our products mainly include roll up, light box, information rack, pop up, x banner, sales promotion etc. Our products are novelty, legerity, good quality & easy carry. \\r\\n\\r\\nPlease have a look at our website http://www.minedisplay.cn/english.\\r\\n\\r\\nWe are sure you will interested in our products.In addition,we also can offer special services according your demands, so do not hesitate to tell us if you did not find what you were looking for.\\r\\n\\r\\nWe hope we can have a chance to cooperate with you and please tell us if you have any questions.\\r\\n\\r\\nYour early reply is very much appreciated:crazyworking@hotmail.com (It’s also the name of my msn.)\\r\\n\\r\\n\\r\\nbest regards.\\r\\n\\r\\nShenyu\\r\\nShanghai mine display equipment Co.Ltd', 'shenyu', 'crazyworking@hotmail.com', '1', '0', '0', '0'),
(7, '2007-06-21 10:16:27', '80.229.32.51', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-GB; rv:1.8.1.4) Gecko/20070515 Firefox/2.0.0.4', '/contact/', 'Just a Test', 'This is just a test to check that the contact form is still working. Ignore it. Cheers.', 'trovster', 'trovster@gmail.com', '1', '0', '0', '0'),
(8, '2007-07-12 16:35:46', '59.93.243.41', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.8.1.4) Gecko/20070515 Firefox/2.0.0.4', '/contact/', 'Freelance web and graphic designer', 'Hi, \r\n\r\nThis is Kim (Full Time Freelance Web/Graphic/Flash/Logo Designer ). I am experienced in Web Design/Flash Animation/Print Designs/Logo \r\nand Banner Design jobs. I have a professional porfolio i can send upon request and have very fair rates. I am looking for freelance projects \r\nand would love the opportunity to work with your company. Please let me know if you would like to see my professional designs. Thanks again \r\nand I look forward to hearing from you.\r\n\r\n \r\n\r\nwebsite  www.mydigitalchocolate.com          \r\n\r\nSome of my web designs\r\n\r\nhttp://kolkatamodels.com\r\nhttp://highwayhardware.com\r\nhttp://www.silversandstage.net\r\nhttp://www.eoctagon.com\r\nhttp://www.nor-media.no/default.asp\r\nwww.seek4light.com\r\nwww.globalrags.com\r\nhttp://www.reopco.com/\r\nhttp://www.buildyourstory.com/mypersonalstory/index.htm\r\nhttp://www.adrenalineathletic.com/\r\n\r\n\r\n\r\nChat\r\n\r\n\r\nkimdesignernext@yahoo.com                    ( yahoo )\r\nkimdesignernext@hotmail.com                 ( msn )\r\narijit_voice                                               ( skype )\r\nkimdesignernextt                                   ( aol )\r\nmydigitalchocolate                         ( google talk )\r\n\r\n\r\nCharges\r\n\r\nFlash Intro   -  starts from 125 USD    ( depends )\r\nFlash Banner  - starts from 20 USD\r\nLogo\r\n\r\nOne idea - 80 USD\r\n3 ideas   -150 USD\r\n6 ideas  - 200  USD\r\n\r\nweb Design layout ( home page )  -  125 USD\r\nhtml pages   - depends/nigotiable\r\n\r\nPrint ( brochure/poster design  )  starts from 75 USD ( per page )\r\n\r\n                              \r\n\r\nwaiting for reply\r\nKim', 'kim', 'mydigitalchocolate@yahoo.com', '1', '0', '0', '0'),
(9, '2007-07-18 07:28:12', '81.130.25.73', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; .NET CLR 1.1.4322; InfoPath.2; .NET CLR 2.0.50727)', '/contact/', 'ZEAL WATER UK', 'HI,\r\nWE REQUIRE A BROCHURE AND/OR PRESENTATION PACK FOR \"ZEAL NATURAL SPRING WATER\".\r\nTHESE MATERIALS ARE TO BE USED TO PROVIDE A STRUCTURED SALES APPROACH TO PROSPECTIVE BUYERS  WITHIN LARGE AND MULTIPLE CASH AND CARRY WHOLESALERS AND RETAILERS.\r\nPLEASE COME BACK TO US AS SOON AS POSSIBLE.\r\nMANY THANKS FOR YOUR CONSIDERATON AND BEST REGARDS.\r\nLUQMAAN\r\n(O7739849981)', 'LUQMAAN', 'luqmaan@lancashirefoods.com', '1', '0', '0', '0'),
(10, '2007-07-24 21:47:40', '81.107.198.27', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-GB; rv:1.8.1.5) Gecko/20070713 Firefox/2.0.0.5', '/contact/', 'Samples', 'We would really appreciate any samples you have of your folders.\r\n\r\nKind Regards\r\n\r\nSimon Dowling\r\nLand-Surv Partnership\r\n3 Heathcote House\r\nTapton Lock Hill\r\nChesterfield\r\nS41 7GE', 'Simon Dowling', 'sdowling@land-surv.co.uk', '1', '0', '0', '0'),
(11, '2007-08-08 08:44:03', '203.101.126.80', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727)', '/contact/', 'free patent searching site', 'I saw your page at http://www.creationserver.co.uk/library.php?area=library§orID=1&clientID=8&projectID=29 and wanted to suggest a resrouce to add: http://www.FreePatentsOnline.com.  This site allows free patent searching, free PDF downloading, free alerts, and more.  It is a good resource for IP attorneys, patent searchers, scientific researchers, students, and small businesses.', 'james ryley', 'james@ryley.com', '1', '0', '0', '0'),
