assle gone - so I hope I can assist you with that :) \r\n \r\nIf you\'re ready and want to watch creation.trovster.com explode with traffic ASAP - go here: http://trafficinstitution.com/traffic-plans/ \r\n \r\nIf you have any questions regarding if we have traffic in particular niches or countries - please email me at admin@trafficinstitutioncontact.com \r\n \r\nHere\'s to your success and quick website growth!', 'John P', 'trafficinstitutionemail@aol.com', '1', '0', '0', '0'),
(89, '2014-12-21 13:50:54', '178.137.85.199', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/39.0.2171.65 Safari/537.36', '/contact/', 'I need creation.trovster.com!', 'Hi, \r\n \r\nI was Googling around and came to creation.trovster.com just now. I surfed around and really liked the site, could I buy banner ad spots on parts of the site? \r\n \r\nIf you already sell adspace - could you give me the details about how many visitors creation.trovster.com gets per month, the country breakdown of what your top 5 or 10 countries the traffic is coming from and the prices for different available spots. \r\n \r\nIf you don\'t sell adspace yet - you\'re missing out on a passive monthly income for having a banner or two up on your site advertising products relevant to creation.trovster.com. If you want to start - I need the monthly visitor count and country breakdown, and if you don\'t know how to put those stats together - just email me at andreiyoung.80@aol.com and I\'ll help you find them. \r\n \r\nPlease also let me know if you\'ve got other websites with traffic that you\'d sell me adspace on - you\'ve got a great quality of websites :) \r\n \r\nEmail me back with the numbers or any questions you have at andreiyoung.80@aol.com \r\n \r\nHope to hear from you! \r\nAndrei', 'Andrei Young', 'andreiyoung80@aol.com', '1', '0', '0', '0'),
