(93, '2015-01-19 20:04:32', '178.137.85.199', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 YaBrowser/14.10.2062.12061 Safari/537.36', '/contact/', 'Is there a Facebook page for creation.trovster.com?', 'Hey, I came to creation.trovster.com and was wondering if you\'ve got a Facebook page? \r\n \r\nI\'m a social media manager at Social Media Gurus and couldn\'t seem to find a Facebook or Twitter page. creation.trovster.com needs a strong social media presence to grow in 2015. Facebook has 1.5 billion users and counting (20 percent of the planet), Twitter has 500 million worldwide users and so on. Not having your business profile up on Facebook is like having a corner store that only takes cash (it’s possible, but you’re missing out on a lot of business). \r\n \r\nWhen you\'re moving, or moved - and are looking for a moving company, or a new hairdresser, organic store, anything - and you Google to find 3 places, 2 with outdated Google reviews and 1 with an FB page of 3,400 likes and a weekly updates featuring new products or coupons - which one are you going to choose? This is why social media is so important in today\'s world - social proof is everything. \r\n \r\nI also understand it\'s a hassle. Hours of browsing and interacting with other peoples profiles to get attention becomes almost a part-time job - not to mention figuring out the best content and info for your followers, informing them you updated it AND having to do that for years to get any respectable profile up - it\'s overwhelming. \r\n \r\nWhich is why I wanted to see if you\'d let me help you manage your social media for creation.trovster.com in the new year and take 95% of the work off your hands! Don\'t worry about getting fans and followers for your Facebook page, I\'ll take care of it and you just focus on finding and making the best content you can for your fans! \r\n \r\nCheck out what I mean here - it\'s really easy: \r\nhttp://socialmediagurus.net/ \r\n \r\nPicking the right plan for you and your social media page is easy. In fact, if you don\'t have a business page for creation.trovster.com yet - I\'ll build you a professional looking one for FREE. \r\n \r\nAll you have to do is update your page daily with interesting things while I handle the growth of the profile COMPLETELY - a steady stream of new REAL fans coming in every day that will like/share/comment on your daily photos and explode the growth of engagement of the page. If you inform me of a special post you\'re planning beforehand - I\'ll ensure you get tons of extra likes to it to bring it to attention amongst your whole group. I guarantee no penalties to your business profile from the social media website ever since all fans and followers are real people who will be interacting on your page daily. \r\n \r\nLetting me take over social media growth for you means that you\'ll see some serious results within a month - all you have to do is update your business page and promote :) \r\n \r\nGet started in 5 minutes here: http://socialmediagurus.net/ \r\n \r\nI\'ve got a small, but super responsive team to handle all your questions and inqueries - please email me at emailsocialmediagurus@mail.com with any questions anytime, and I hope I can help creation.trovster.com grow a lot bigger this year! \r\n \r\nTo your success, \r\nDevin', 'Devin', 'understoodyacht3c@rediffmail.com', '1', '0', '0', '0'),
