(1, 1, 1, 1, '2007-04-28 15:35:07', '2007-04-28 15:35:07', 'New Rules for Websites', 'new-rules-for-websites/', 'An update to the Companies Act legislation of 1985 has now come into force. To avoid breaching the Companies Act 2006, from the 1st January 2007, all UK Limited companies must include certain information on their websites, email footers, order forms and electronic documentation.', 'An update to the Companies Act legislation of 1985 has now come into force. To avoid breaching the [Companies Act 2006](http://www.dti.gov.uk/bbf/co-act-2006/index.html), from the 1st January 2007, all UK Limited companies must include certain information on their websites, email footers, order forms and electronic documentation. The penalty for non-compliance is a £1000 fine.\r\n\r\nEvery company should list registered company name, company registration number, place of registration, registered office address and VAT number (if applicable). This information is already required on business letters and should, as a matter of good practice, be included on all your company documentation.\r\n\r\nIf you would like our help to implement these updates on any of your corporate websites and documentation please [email us](mailto:info@creation.uk.com) and we will offer our advice.', '0', '1'),
(2, 2, 2, 1, '2007-05-08 10:35:07', '2007-05-08 10:35:07', 'Running for Charity', 'running-for-charity/', 'The 2007 BUPA Great North Run will take place on Sunday 30th September 2007 celebrates it\'s 27th anniversary, and promises to be a day to remember! It\'s the world\'s biggest half marathon, a point-to-point 13.1 mile course starting in Newcastle and finishing in South Shields.', 'The [2007 BUPA Great North Run](http://www.greatrun.org) will take place on Sunday 30th September 2007, it\'s 27th anniversary, and promises to be a day to remember! It\'s the world\'s biggest half marathon, a point-to-point 13.1 mile course starting in Newcastle and finishing in South Shields. Over 50,000 runners lined up at the start last year - with hundreds more people watching it from the sidelines and coverage on the BBC.\r\n\r\nLuckily, I have managed to get through the selection process to take part in the event this year. This will be my third half marathon. At the moment I have done two, [The Stafford Half Marathon in 2006](http://www.staffordbc.gov.uk/static/page1784.htm) and in 2007.\r\n\r\nI won\'t be breaking any [half marathon records](http://en.wikipedia.org/wiki/Half_marathon), but will be raising money for my preferred charities, [The Donna Louise Trust](http://www.donnalouisetrust.org) and the [NSPCC](https://www.nspcc.org.uk). As you can guess I am looking for sponsorship to help out these two very worthy causes. Any amount no matter how small will go to help unfortunate children.\r\n\r\nThe run is going to be televised so perhaps you would like me to wear something branded with your company logo for a donation. A t-shirt, cap, badge, stickers, flag or anything else you may suggest. I may even wear a stupid costume if the donation is high enough. I will have to draw the line at high heels though and save that sort of thing for my private weekend activities.\r\n\r\nIf you would like to help with a donation [drop me an email](mailto:leigh@creation.uk.com) or give me a call at the office on 01785 716136. Thanks Leigh.', '0', '1'),
(4, 2, 2, 1, '2007-05-28 14:40:09', '2007-11-01 18:24:16', 'In Partnership with Xerox Global Services', 'in-partnership-with-xerox-global-services/', 'Last year we were chosen as a new design partner for Xerox Global Services, the division of Xerox responsible for offering\non-site services for a large number of big companies and organisations nationwide.', 'Last year we were chosen as a new design partner for Xerox Global Services, the division of Xerox responsible for offering on-site services for a large number of big companies and organisations nationwide.\n\nSince our introduction to the various sites we have completed a number of projects with successful results. All our services, including the fixed price packages and solutions listed in our services section, are available to all sites and all Xerox Global Services customers. There are some services available you may not be aware of, in fact, we may not be aware of them yet! Remember, if you have a design, web or print problem to solve just ask. We\'ve been able to help already on a number of occasions with excellent results.\n\nWe look forward to building a stronger relationship with Xerox Global Services and their customers and providing the very best in design for print and web.\n\nIf you need any further help or advice on our partnership and what we can do for you, contact me [leigh@creation.uk.com](mailto:leigh@creation.uk.com), your print room manager or Xerox Global Services representative.', '0', '0'),
(3, 2, 2, 1, '2007-05-20 15:50:26', '2007-05-20 15:50:26', 'Donate Unwanted PCs', 'donate-unwanted-pcs/', 'Help students in The Gambia with your unwanted PCs by collecting computer equipment for students to use in Gambia. Tamworth & Lichfield College have made arrangements to ship any PCs capable of running Windows 2000 to the College in The Gambia.', 'Help students in The Gambia with your unwanted PCs. Following a visit to the region by our good friends at [Tamworth & Lichfield College](http://www.tlc.ac.uk), John Fontaine and Belinda Ball, we are trying to help them collect computer equipment for students to use in Gambia.\r\n\r\nThis part of the world is very poor but everyone is keen to learn. The students have very limited facilities at present and in some cases are using very old manual typewriters to learn keyboard skills. So our unwanted PCs would be a distinct step up for them.\r\n\r\nJohn and a friend of the College have made arrangements to ship any working PCs, capable of running Windows 2000, to the College in The Gambia. A container will be packed up and sent over when it\'s full. [Let me know](mailto:leigh@creation.uk.com) if you have any PCs you would like to donate.\r\n\r\nYou could also be saving money by helping out, now the Regulations implementing the [WEEE Directive](http://www.netregs.gov.uk/netregs/legislation/380525/473094/?lang=_e) (Waste Electrical and Electronic Equipment) in the UK were entered into force on 2nd January 2007. A directive to promote recycling and reduce waste. Find out more about the WEEE Directive and [get Free Advice](http://weeenetwork.com) for all businesses affected by the regulations.', '0', '1'),
(5, 1, 1, 1, '2007-06-05 10:34:14', '2007-06-05 10:34:14', 'Cycle Scheme', 'cycle-scheme/', 'Recently I had a fantastically silly idea — I\'ll start cycling to work. I found out about a government funded Cycle Scheme which saves you money by allowing you to get a bike tax free. If you\'re planning on cycling to work in the near future persuade your employer to sign on to the Cycle Scheme. Get a new bike and save some money in the process, all in time for the summer.', 'Recently I had a fantastically silly idea — I\'ll start cycling to work. After looking around on a few websites I found a bike I was happy with, a Specialized Hardrock. However, I then found out about a government funded [Cycle Scheme](http://www.cyclescheme.co.uk) which allows you to get a bike tax free.\r\n\r\nThe [Cycle Scheme](http://www.cyclescheme.co.uk) works in saving you money in a few ways. Firstly, your company buys the bike VAT-free. Secondly, the bike is paid for over a period of twelve or eighteen months, with the money coming directly from your wages. This means two things: you\'re basically getting the bike interest-free for the length of the term repayments and you are saving both national insurance and income tax because the payment comes out *before* these are calculated and taken.\r\n\r\nBeware, although the repayments may look higher than you expected and total more than you expected to save over the course of the year, the [savings calculator](http://www.cyclescheme.co.uk/employee,calculator.htm) is actually pretty accurate. If you calculate your net pay sacrifice over the term of your repayments, the total is more or less the same as on the [savings calculator](http://www.cyclescheme.co.uk/employee,calculator.htm) because you\'re paying less tax over the year.\r\n\r\nOpting in to the [Cycle Scheme](http://www.cyclescheme.co.uk) was a fairly easy process (at least for me as the employee), although it did feel like it took longer than necessary. Just [ask your employer to sign up](http://www.cyclescheme.co.uk/employer,register.htm) for the scheme, then find a local bike shop (or online retailer) who participate. The Cycle Scheme website has a page to [help you find your nearest participating retailer](http://www.cyclescheme.co.uk/bikeshop,partner_finder.htm) - simply enter your postcode and away you go!\r\n\r\nWith the savings I was able to enjoy with the scheme I decided to get a Specialized Rockhopper Pro instead. It looks amazing, it\'s very lightweight and rides nicely. Unfortunately, it is *not immune* from **getting punctures** which I found out on my first sixteen-mile return trip to work.\r\n\r\nOverall, if you\'re planning on cycling to work in the near future, or if you already cycle to work but are looking to replace your worn-out ten-year-old bike, definitely persuade your employer to sign on to the [Cycle Scheme](http://www.cyclescheme.co.uk) which means you will save yourself some money and get a fresh new bike — just in time for a glorious summer.', '0', '1'),
(6, 3, 3, 1, '2007-06-06 15:21:22', '2007-06-06 15:21:22', 'Easy Money?', 'easy-money/', 'Monday 4th June saw the unveiling of the logo for the 2012 Olympics and Paralympics in a star-studded ceremony in London. Swiftly followed by a torrent of criticism, every non-designer could have done a much better job. What do we think?', 'Ok. I\'ll keep this short because it\'s day two and I\'m sure you are already tired of the new [London 2012](http://www.london2012.com) Olympic logo scandal.\r\n\r\nI picked up the general vibe of disapproval through the media a few hours before I saw the logo and couldn\'t wait to form my own opinion on this \"*obscene waste of tax payers money*\". \r\n\r\nMy initial reactions were \"*it\'s not what I expected*\" and \"*it\'s also very basic*\" – and for me, these two reactions are both positive ones.\r\n\r\nI expected to see a flowing, freehand, prancing human form suspended over the word \'London\' in an optimistic script font - like many of the European sporting events that have come before. Thankfully the logo is nothing like this. It\'s simple, as all good logos should be, and must be seen in context to be properly appreciated. I\'m truly relieved that the design has avoided the red, white and blue, British war-paint colourway, designed to intimidate non patriots. [The Olympics](http://www.olympic.org) is a no prejudice global gathering not a fight on our turf.\r\n\r\nI understand the general public\'s reaction to a cluster of geometric shapes baring a price tag of £400,000. However, consider the research and deliberation behind a complete and incredibly high-profile graphic identity for an international event, coordinated by an agency with the branding pedigree of [Wolff Olins](http://www.wolffolins.com) and the price seems quite reasonable to me.\r\n\r\nIn my opinion the new London 2012 Olympic logo is unique and distinguishable and the work behind it\'s creation should not be underestimated. Like [Kelly Holmes](http://en.wikipedia.org/wiki/Kelly_Holmes), [Michael Johnson](http://en.wikipedia.org/wiki/Michael_Johnson_%28athlete%29), [Jonathan Edwards](http://en.wikipedia.org/wiki/Jonathan_Edwards_%28athlete%29), [Asafa Powell](http://en.wikipedia.org/wiki/Asafa_Powell) – true experts in their field make it all look so easy.\r\n\r\nNo doubt that the [2012 Olympics](http://www.london2012.com) will be an historic and spectacular event. As for the logo, it\'s appeal will grow - trust me.', '0', '1'),
(7, 2, 2, 1, '2007-06-29 14:58:36', '2007-06-29 14:58:36', 'A Useful Link', 'a-useful-link/', 'Business Link offer a wide range of help and funding for businesses of all sizes. The website is crammed with useful information and details of what help is available. Find your local Business Link branch and call them to see what grants are available to you. If I can be of any help, just let me know and I will point you in the right direction.', 'Whilst looking through the [Business Link website](http://www.businesslink.gov.uk) I wondered how many of you have spoken to Business Link and taken advantage of what they have to offer. \r\n\r\nThe site itself is crammed with useful information and details of what help is available. The section on [grants](http://www.businesslink.gov.uk/bdotg/action/layer?r.l1=1073858790&topicId=1073866776&site=131&r.s=tl) is particularly interesting as you can enter a few details to see what funding is there for you to apply for. Give them a call, and see how they can help you. We\'ve dealt with many people from Business Link and I can honestly say they are always very helpful and professional. Many of our clients have benefited and received grants towards websites, design work and other consultancy fees. The most recent of which is [Instant Training](/portfolio/websites/instant-training-website/) based in Telford, who have just seen their gorgeous new site go live.\r\n\r\nTo make it easier for you, [Creation](/) are on the approved list of Business Link Consultants and have been for a number of years. This means, if you ask us to do the work, you can claim any grant assistance available to you. Sometimes this can be up to 50% towards the cost of a new website, for example. \r\n\r\nFind your [local Business Link branch](http://www.businesslink.gov.uk) and call them to see what\'s available to you. If I can be of any help, just let me know and I will point you in the right direction.', '0', '1'),
(8, 1, 1, 1, '2007-07-17 13:07:19', '2007-07-17 13:07:19', 'Web Usability Basics', 'web-usability-basics/', 'Web usability is an integral part of building a website. This article includes some simple tips and tricks that we concluded from a recent study, which can improve the usability of your website and add significant value to your online presence.', 'In a recent usability study we carried out on behalf of Kingston College we noticed a few common issues which a lot of websites have. There are a few basic issues which are often overlooked, but can be resolved relatively easily. Web usability should be an important focus when commissioning a new website as it can add significant value to your online presence.\r\n\r\n> Development projects should spend 10% of their budget on usability. Following a usability redesign, websites increase desired metrics by 135% on average.  \r\n[Return on Investment for Usability](http://www.useit.com/alertbox/20030107.html) by Jakob Nielsen.\r\n\r\nBelow are a few common usability blunders and how to solve them.\r\n\r\n1. Every page (except for the homepage) should have an obvious link back to the homepage. The words \"Home\" should be used in the majority of cases. Other ways can be used as well, but these should be *in conjunction* with an explicit link.\r\n\r\n2. The company logo or site banner should be placed in a prominent position at the top of the design – convention tends towards the top-left, and user-expectation dictates that the logo should link back to the homepage.\r\n\r\n3. Navigation should be in a consistent, prominent position and be obvious of it\'s function. The current active section should be highlighted sufficiently differently from the other links in the main navigation. The navigation should be clear and answer three questions: Where am I? Where have I been? and Where can I go?\r\n\r\n4. Your homepage should clearly articulate who you are, what you do, what your site offers and why it is of value to users. This is usually achieved by a one sentance tagline/strapline which should appear in the site\'s window title and on the homepage.\r\n\r\n5. Content should be clear, simple and concise. Information should be easy to scan as findability is paramount in user experience. You should avoid using jargon and write using plain and easy to understand terminology. Lists and short paragraphs are quick to read and easy to digest.\r\n\r\nThese easy steps can vastly improve the usability of your website. Better usability will keep users interested and engaged with your content because their experience of your site was pleasant. Users will return often and are more likely to recommend your site.\r\n\r\nIf you have any other tips you wish to share with us, please place them in the [comments](#comments-form) below.', '0', '1'),
(9, 2, 2, 1, '2007-08-14 10:39:53', '2007-08-14 10:39:53', 'Entry to e-marketing', 'entry-to-e-marketing/', 'If you\'ve taken a look through our site recently you may have noticed we offer a number of fixed price packages and solutions. You now have access to a new solution to allow you to take your first step into e-marketing with our new e-shot package.', 'If you\'ve taken a look through our site recently you may have noticed we offer a number of fixed price packages and solutions. You now have access to a new solution to allow you to take your first step into e-marketing – our new [e-shot package](/services/advertising/e-shot-design/) starting at £695.\r\n\r\nAn e-shot is the electronic equivalent of direct mail, sent and received as an email. Recipients of an e-shot are usually your current customers or anyone who has requested regular updates or subscribed to your newsletter. An e-shot can take the form of a simple news bulletin or a marketing message about a new product or service. The advantages of using this medium to contact your customers are the speed a campaign can be created, the cost effectiveness and the ability to monitor the success of your campaign.\r\n\r\nFor just £695 we will design the e-shot using your text and images, create the ready-to-send version and then, following approval, send the e-shot to your list of up to 500 recipients. You will then get access to the campaign statistics to monitor the effectiveness of the campaign. Plus, if this is the first time you have used our services, you can get £100 off any of our other packages or solutions and take part in a complementary PROBIZ Edge™ business advice workshop session worth £293. For the power users out there we offer a complete online e-shot solution to allow you to create, manage, send and monitor your own campaigns.\r\n\r\nYou can [email](mailto:leigh@creation.uk.com) or call me on 01785 716136 if you would like to find out more about e-shots.', '0', '1'),
(10, 4, 4, 1, '2007-09-06 14:53:06', '2007-09-06 14:53:06', 'Why the Helvetica?', 'why-the-helvetica/', 'People have asked me why Helvetica is so commonly used in design. This article scratches the surface of what makes it such a usable, versatile font, explains why designers use it and invites your opinion.', 'People have asked me why Helvetica is so commonly used in design. I\'ve heard comments like \"It\'s boring\", and \"It\'s just the default font in Word\". \r\n\r\n[Helvetica](http://en.wikipedia.org/wiki/Helvetica) is a sans-serif typeface developed in 1957 by Swiss graphic designer Max Miedinger and has earned its respect with designers because it\'s simply one of the most versatile font sets in existence. With an extensive range of weights and styles it can span many applications from industrial signage to fashion brands. And in practical terms, Helvetica\'s small \'x\' height makes typography ledgible at smaller point sizes, which in turn allows a greater word count per page.\r\n\r\nMost people\'s experience of Helvetica will probably be as a system font on their PC, where they don\'t have access to the full range of weights Helvetica offers; which is a real shame, as it deprives these users of its true strength – its versatility.\r\n\r\nIn some respects its popularity has been its undoing. The general consensus is that the decision to use Helvetica is one that \'lacks creativity\' in itself, and in many ways that\'s true, given that is has been used so badly, so often. The truth is, however, that any design can carry a thoughtful typographic use of Helvetica.\r\n\r\nI\'m not saying Helvetica is the solution to every problem, but it\'s difficult deny the font\'s usability and longevity. I\'ve grown to appreciate Helvetica the more I work with it, not only for it\'s sheer range of usable weights but for it\'s pure simplicity and clarity. I love it.', '0', '1'),
(11, 1, 1, 1, '2007-09-18 12:52:05', '2007-09-18 12:52:05', 'dConstruct 2007', 'dconstruct-2007/', 'Last week I had the pleasure of attending dConstruct; a grass roots conference in Brighton, UK. This year the conference topic was Designing the User Experience and featured presentations from Jared Spool, Peter Merholz and Tom Coates.', 'Last week I had the pleasure of visiting Brighton to attend the [2007 dConstruct conference](http://2007.dconstruct.org \'User Experience Design Conference\'). This is a small grass roots conference by [Clearleft](http://clearleft.com \'Web Design and Accessibility Consultants\') which is billed as \'an affordable, one-day conference aimed at those designing and building the latest generation of web-based applications\'. The topic for this third annual conference was **Designing the User Experience**.\r\n\r\n[Jared Spool](http://www.uie.com \'User Interface Engineering\') opened the conference with his enthusiastic, engaging and entertaining presentation entitled \"*The Dawning of the Age of Experience*\". Jared talked about the iPod (as did almost every presentation). The iPod isn\'t the best MP3 player technologically speaking, but because the user experience is so rich the device is by far the highest selling product in the market. The iPod doesn\'t have all the features other MP3 players have, but functionality commonly found on other devices has been cleverly moved to iTunes. More often than not you manage your music on a computer and Apple has recognised this behaviour. They have moved such functionality to iTunes leaving the iPod less cluttered and easier to use – all which lead to *great user experience*. This great user experience is something you should be building in to every service you provide.\r\n\r\nJared also compared [Netflix](http://www.netflix.com \'Netflix DVD Rental\'), a relatively new online-only movie rental company, to [Blockbuster](http://www.blockbuster.com), the well established DVD rental company, with over five-thousand stores in the US alone. Over recent years Netflix has become twice as large as Blockbuster. But they don\'t advertise and they don\'t have retail stores, so why have they become so successful? They found out 85% of existing customers had a friend recommend the service to them. Because they spend their money of designing their website and improving user experience, they do not need conventional marketing to become extremely successful. **User experience makes and breaks products and services.**\r\n\r\nJared was followed by another American, [Peter Merholz](http://peterme.com \'Links, thoughts, and essays from Peter Merholz\'), who works for [Adaptive Path](http://adaptivepath.com \'An experience strategy and design firm based in San Francisco\') and talked on the subject of \"*Experience Strategies*\". Peter started with a history lesson about camera development in the late eighteen-hundreds.\r\n\r\nUp to the turn of the nineteenth century, photography wasn\'t very accessible, requiring complex understanding of fundamentals and needing seventeen steps to complete the process. Kodak developed a \"3 step camera\" and their slogan was \"*You press the button, we do the rest*\". Kodak didn\'t change how photographs were developed, they simply recognised that the user should not need to know this information to take photographs. All the user had to do was push the button and send the film off, Kodak then did the rest. And because of this user experience Kodak have been the premier brand in the photography industry for over one hundred years.\r\n\r\nSecondly Peter talked about a pyramid of product evolution:\r\n\r\n* At the bottom is the underlying product technology.\r\n* Second are features. Features make technology more usable. Beware, simply cramming in features can ruin a product.\r\n* Finally, experience is the most important part of the pyramid. Focus on what people want to do, and hide the rest — see the iPod!\r\n\r\nAll these steps are required and each is important, but the user experience can either ruin or make the product a great success.\r\n\r\nThe first two presentations complemented each other perfectly. Peter referenced and expanded upon information which Jared had just talked about and the two speaker styles fitted together very well. Both speakers were engaging, knowledgeable and able to communicate their experience extremely well.\r\n\r\nAfter lunch [Jeremy Keith](http://adactio.com), one of the event organisers, introduced [Cameron Moll](http://cameronmoll.com \'Authentic Boredom is the platitudinous web home of Cameron Moll\') for the so-called \"graveyard-watch\", in which he presented \"*Good vs. Great Design*\". Cameron talked about choices which distinguish great design from good design and stated that this contributes to user experience because \"great design yields meaningful communication\". Cameron posed the following question, which I felt was intriguing…\r\n\r\n> ####Using a microwave, which takes less time?####\r\n\r\n> 1. Heating water for **one minute** and **ten seconds**?\r\n2. Heating it for **one minute** and **eleven seconds**?\r\n\r\nA trick question? Partially. Below this question Cameron stated \"User productivity trumps machine productivity\". Although it maybe quicker for the machine (microwave), the overall process for the *user* is slower. In choice one the user has to locate two buttons, 1 and zero, which are usually positioned away from each other. The second choice requires one button, and therefore is quicker for the user. This is very important to remember when developing any software applications, you should think about user efficiency over the ease of programming.\r\n\r\nFinally, the conference finished with [Tom Coates](http://plasticbag.org \'A weblog by Tom Coates concerning future media, social software and the web of data\'), a former employee at the BBC who is currently heading up a very interesting research project called [FireEagle](http://fireeagle.research.yahoo.com) at Brickhouse Yahoo!. Tom talked on the most technical-orientated subject of the day in his presentation \"*Designing for a Web of Data*\".\r\n\r\nI am very interested in the \'web of data\' idea – all of the possibilities and phenomenal potential it contains. I believe this topic will be a huge part of the internet in the next few years. If you are intrigued I highly recommend viewing Tom\'s other presentation on the subject \"*Native to a Web of Data*\". You can [view the slides](http://www.plasticbag.org/archives/2006/02/my_future_of_web_apps_slides/) and [listen to the audio](http://www.carsonworkshops.com/summit/2006/london/ \'Audio from all the presentations at The Future of Web Apps 2006\') from the presentation which I watched at The Future of Web Apps in early 2006.\r\n\r\n####Other presentations####\r\n\r\n[Leisa Reichelt](http://www.disambiguity.com) presented \"*Waterfall Bad, Washing Machine Good*\" in which she talked about project development methodologies, discussing the differences between sequential methodologies and \'iterative, incremental and collaborative/cross-disciplinary methodologies\'. The talk was more project-management orientated, but enlighten the benefits of Agile and User Centred Design (UCD) practices.\r\n\r\n[George Oates](http://george08.blogspot.com) and [Denise Wilton](http://www.kaiusdesign.com) had an informal chat on the sofa entitled \"*Human Traffic*\". These two talked about the processes their respective companies go through when making design and interface choices and how they are handled in the fast response/feedback nature of the internet. Personally, this was my least favourite talk of the conference.\r\n\r\n\"*The Experience Stack*\" presented by [Matt Webb](http://interconnected.org/home/) was an interesting talk. Matt threw away common presentation structure and gave a sporadic and sprawling talk about \'experience\'. I felt some of the slides were confusing and because of the unrelated nature of the presentation, understanding the overall premise was difficult. Matt has [understood there was a problem](http://schulzeandwebb.com/blog/2007/09/09/the-experience-stack-at-dconstruct-2007/ \'The Experience Stack at d.construct 2007\') with his talk but has tried to address this in an article called [The Experience Stack revisited](http://schulzeandwebb.com/blog/2007/09/09/the-experience-stack-revisited/). Matt has put his [slides online](http://schulzeandwebb.com/2007/stack/) with extensive notes.\r\n\r\nOverall I really enjoyed the conference and thought it was a great success. [Andy Budd](http://www.andybudd.com), one of the organisers, [summed up the conference](http://www.andybudd.com/archives/2007/09/deconstructing/ \'deconstructing dConstruct 2007\') and mentioned what I felt about conferences in general:\r\n\r\n> The best conferences I find are always the ones that try to inspire rather than educate. … [we] walked into the office this morning with a renewed interest in our field and a desire to try out some new techniques and ideas. I hope you felt the same way.\r\n\r\n**I did.**', '0', '1'),
(12, 2, 2, 1, '2007-10-11 11:50:16', '2007-10-11 14:32:33', 'Education in Print', 'education-in-print/', 'Further education colleges up and down the country are finalising their course guides for the 2008 intake. This week\r\nTamworth\r\n& Lichfield College and Kingston College will be receiving their newly printed course guides from us.', 'It is that time of year again. Further education colleges up and down the country are finalising their course guides for the 2008 intake. This week **Tamworth & Lichfield College** and **Kingston College** will be receiving their newly printed course guides from us.\r\n\r\nFor most colleges there are two major publications each year, the part time guide and the full time guide. The part time guide is usually published during the Summer term for the intake of part time students in September of the same year. The full time guide is completed and printed over the Summer or early in the Autumn term. This guide is then sent out and made available to potential students joining the college in September the following year. This poses a few presentation problems for colleges as you have two publications initially out at similar times but overlapping with each other during previous and following years. However, if a design strategy is in place for organic development of design styles the college branding is upheld and publications happily blend from one to another. This is something we try to implement with everything we do for our college clients.\r\n\r\nWith a few colleges we have managed to build a long standing relationship and help them at every step of the way. This consistency and commitment from us to always give the very best has paid dividends, with exceptional inspection reports and positive feedback from both students and staff. This commitment and dedication is something we offer all our clients, after all, creating the perfect solution is always our goal.\r\n\r\nCreation has worked with a long list of colleges over the years, completing almost 700 education projects. These include corporate ID, course guides, part-time guides, full-time guides, diaries, websites, international publications, advertising, display panels, posters, photography, signage, touchscreens and a whole lot more. As you can see we have masses of experience in the education sector and can always offer the best, most efficient solution to any problem. We are finding more and more that new technology and techniques are paving the way to cost effective solutions with online developments providing the key.\r\n\r\nIf you would like to find out more about how you can benefit from our education experience just drop me an email [leigh@creation.uk.com](mailto:leigh@creation.uk.com).', '0', '1'),
(13, 1, 1, 1, '2008-01-10 10:49:17', '2008-01-10 13:21:56', 'Microformats', 'microformats/', 'Microformats are a simple, standardised way of extending the language of the web (HTML) to imitate existing standards (for example, vcard, atom, etc.). Webpages which use Microformats can then be parsed and exported for use within other applications.', '[Microformats](http://microformats.org) are a simple, standardised way of extending the language of the web (HTML) to imitate existing standards (for example, vcard, atom, etc.). Webpages which use Microformats can then be parsed and exported for use within other applications.\r\n\r\nMicroformats were first announced over two years ago and since then have gained massive traction as developers simply started modifying their existing infrastructure to include this extra data. The tech industry major players all agree on the importance of Microformats. At Mix06, Microsoft CEO Bill Gates stated [\"We need Microformats\"](http://microformats.org/blog/2006/03/20/bill-gates-at-mix06-we-need-microformats/). Since then, Yahoo! has integrated Microformats in to literally millions of pages. [Yahoo! Local](http://microformats.org/blog/2006/06/21/yahoo-local-supports-microformats/) supports hCards, hCalendars and hReviews and Yahoo! acquisitions Flickr and Upcoming support hCards and events respectively.\r\n\r\nWe understand the importance of Microformats here at Creation. Our [profile pages](/company/trevor-morris/ \'Profile for Trevor Morris\') contain hCards. Our hot topics, news articles and comments are all marked up with hAtom, which allows users to subscribe to these pages and their changes automatically.\r\n\r\nAll of our [web packages](/services/websites/) contain Microformats to varying degrees. Each page on our packages uses the hAtom syntax and your company details are marked up as a hCard. If you use address module (available in [GoActive packages](/services/websites/goactive/) and above), more information is added, including address and telephone number – this information can be exported to vCard-compatible address management tools, such as Outlook or Address Book for the Mac.\r\n\r\nIf you use or buy one of our [web packages](/services/websites/) (or any custom website) you\'ll understand the immediate advantages of Microformats this coming year. Browser manufactures are integrating features which will make interacting with Microformat-enabled websites a breeze. Look out for these features in the upcoming Firefox 3 and the next Internet Explorer.', '1', '1'),
(14, 1, 1, 1, '2007-10-15 15:14:16', '2007-10-15 15:14:16', 'Get Firefox', 'get-firefox/', 'If you only do one thing today, please save mine and millions of other web developer\'s sanity. Ditch Internet Explorer and use Mozilla Firefox instead.', 'If you only do one thing today, please save mine and millions of other web developer\'s sanity. Ditch Internet Explorer – [use Mozilla Firefox](http://www.mozilla.com/firefox/) instead. If you already use Firefox (or at least not IE), then *you\'re awesome* and you can stop reading now. If not, I beg you to read on…\r\n\r\nIf you are always been referred to as the \'geek\' or \'techie\' between your friends and family, yet they always want you to fix their computers for free, [simply install Firefox for them and make it look like Internet Explorer 6.](http://johnhaller.com/jh/mozilla/firefox_internet_explorer/) This will help to keep any unwanted toolbars and malicious software off their machines, which hopefully means they will stop asking you why their computers are running at a snails pace. You also won\'t have to [remove all the spyware](http://browsehappy.com/why/ \'Browse Happy\') they\'ve \'acquired\', meaning you won\'t be wasting countless hours on free tech support. If you\'re a web developer those saved hours can then be spent on fixing your web designs in the dreaded browser!', '0', '0'),
(15, 3, 1, 1, '2007-10-18 10:50:00', '2007-11-01 16:48:07', 'Reasons to re-brand', 'reasons-to-rebrand/', 'There are many reasons for re-branding – I have put together some points about re-branding to help you determine whether\nit\'s time for a corporate make-over.', 'There are many reasons for re-branding - an external event may have changed the position for your product in the market place, maybe you have recently merged with another company or most commonly you recognise that you simply need a fresh change of clothes to stay inline with the competition. Popular consumer brands are ever evolving their marketing and packaging in an attempt to endear customers through the \'attitude\' and \'personality\' of their brand.\n\nI remember when Bradford and Bingley were two middle-aged gentlemen in pinstripe suits and bowler hats, presumably because only \'business men\' have bank accounts - right? The latest face of Bradford & Bingley is an attractive and friendly young woman in a lime green shirt and, of course, a bowler hat - which is now just for comedy effect, oh and brand recognition. Perfectly approachable and without a whiff of stock-market or Financial Times about her.\n\nI have put together some points about re-branding, really in terms of the evolution of an existing corporate ID rather than a total corporate rebirth, to help you determine whether it\'s time for a fresh set of clothes.\n\n\n####10 Reasons to re-brand####\n\n* To revitalise an existing brand\n* To incorporate major changes in the product or service\n* To improve customer connection\n* To improve the image of the product and increase sales\n* To increase competitiveness and reduce threat from new entrants\n* If you don\'t already have a brand, you have a collection of logo versions and collateral materials\n* If you feel you have lost touch with the people you intended to attract\n* If you want your company to appear \'forward thinking\'\n* If your competition has a better image\n* If your customers don\'t recognise your brand or can\'t figure out what you do\n\n\n####5 Re-branding fears####\n\n#####*Existing customers will not recognise us*#####\n\nIt is a common concern that change could put a lot of goodwill and customer loyalty at risk. I would not condone a re-brand that was a complete U-turn unless the current brand was obviously turning customers away. These days people expect improvements to products and services which cater evermore specifically to the needs of the individual. A modest brand makeover could actually help to reinforce existing customer loyalty by contributing to \'post purchase justification\' and ultimately attract new ones. \n\n#####*It will cost too much*#####\n\nWhat better reason could there be? The knock-on effect of a complete re-brand is undoubtedly a lengthy and costly exercise. My advice here would be evolve the brand over time and introduce changes in smaller steps - this way the cost of the new look would be built into the next print run or advert placement, website update or exhibition in such a way that two generations of corporate ID could co-exist and retain synergy. Car manufacturers constantly introduce \'evolutionary\' style changes across their model range without letting a single model become the black sheep.\n\n#####*If it ain\'t broke…!*#####\n\nI would be the first to agree that this is a strong argument against a wash and brush up. This attitude suggests that you are obviously doing something right - for now. However, in any marketplace expectations are constantly rising and it is always prudent to keep a close eye on the competition.\n\n#####*I\'m skeptical about the benefits of a cohesive brand*#####\n\nI\'ve heard this argument many times and usually goes hand in hand with acute niché markets or the very naive. If you are lucky enough to have a product or service that wouldn\'t benefit from a clear brand, marketing plan or customer focused service standards then keep up the good work. As for the rest, you probably won\'t need to use your seat-belt on the way home either.\n\n#####*People will think we have resurrected a failed business*#####\n\nWell have you? This mindset might strike fear into the heart of a supplier who\'s hanging on for that \'check in the post\' but if you feel you have found a great name and can provide real value and meaning to your product or service this could be exactly what your brand needs. You can advertise your re-brand as a celebration of success, and at the same time attract interest away from the competition.\n\n#####*-*#####\n\nIt is difficult to attribute success to any single influence. The quality of your product or service, customer brand loyalty, the effectiveness in which you communicate to your market and how you compare to the competition are just a few of the factors that contribute to securing a sale. But I would always prefer to make a good impression when I take my brand to market, than hope no-one notices it.', '1', '1'),
(16, 1, 1, 1, '2007-10-25 09:45:53', '2007-10-25 09:58:41', 'Our Web Packages & SEO', 'our-web-packages-seo/', 'Many people will have heard of SEO or Search Engine Optimisation. This is an industry which helps companies with a web\r\npresence achieve better rankings within search engines. There are a lot of techniques used by such companies. Some of these\r\ncan improve your rankings, however, some can adversely affect your business.', 'If you\'re looking for a [new website](/services/websites/ \'Check out our Website Packages\') or already have one, getting visitors to your website is a primary goal. SEO or [Search Engine Optimisation](http://en.wikipedia.org/wiki/Search_engine_optimization) is the set of techniques which will help you achieve this goal.\r\n\r\nThe SEO industry helps companies with a web\r\npresence achieve better rankings within search engines. There are a lot of different methods used by SEO companies. Some of these can improve your rankings. Others, however, can adversely affect your business.\r\n\r\nA lot of the reasons behind using a company specialising in SEO no longer apply in the web-standards based development environment. [Our web packages](/services/websites/) are built with all the best practices in mind. Because of this, large, expensive and involved after-market SEO campaigns are almost always unnecessary and usually have very little impact on your search enginge ranking.\r\n\r\n[Our web packages](/services/websites/) employ numerous techniques which help your site gain good results in search engines from day one. We use the following techniques to help you achieve good search engine rankings:\r\n\r\n####Structured, semantic HTML####\r\n\r\nOur web packages are built using the latest web standards best practices. The templates use semantic HTML and are styled with CSS. [Microformats](http://microformats.org) are also used throughout the packages. All of these factors help search engines understand your content and allow them to process the information better.\r\n\r\n####XML sitemaps####\r\n\r\nOur web packages automatically generate [XML sitemaps](http://sitemaps.org) for your entire site. When we complete your website, we also submit them to Google and Yahoo! This helps search engines find your site and all your pages. If your website is brand new, this is a great starting point, especially if your website does not have any incoming links.\r\n\r\n####Nice and SEO-friendly URLs####\r\n\r\nOur web packages also generate your page URLs based on the title of your page. This has a threefold effect. Firstly, it means the URLs are easy to read, understand and remember. Secondly, because the URLs are based on your page title, the keywords of each page are duplicated. Finally, search engines emphasise words within the URL, so your keywords are even stronger.\r\n\r\nEvery website we build, whether it\'s a [web package](/services/websites/) or completely custom, features all these SEO-based techniques.\r\n\r\n####Completing your SEO Campaign####\r\n\r\nThere are two other influential factors which will help make your SEO campaign a success. First of all we can advise on the content for your site – remember [content is king](http://www.akamarketing.com/content-is-king.html \'An Internet marketing article by David Callan\'). And we can also help you build links to your website because the more ways search engines can find your site the better! These two factors will have the biggest impact in your search engine ranking.\r\n\r\nIf you wish to find out more, please [get in touch](/contact/).', '1', '1'),
(17, 1, 1, 1, '2008-01-29 12:11:00', '2008-01-22 16:21:09', 'Multipack Refresh', 'multipack-refresh/', 'The Multipack, a two-year old community from the Midlands, UK, has relaunched this week. With a refreshed website and new\r\nideas, the Multipack is a group anyone in the Midlands should know of.', '[The Multipack](http://www.multipack.co.uk) is a community of multi-talented individuals from across the Midlands UK, that come together to discuss all the things web and share their knowledge, skills and talents. I have been a [member](http://www.multipack.co.uk/regulars/trevor-morris/ \"Multipack member\'s page for Trevor Morris\") of the group for over two years and it is a great opportunity to meet like minded developers, designers and make new and exciting collaborations.\r\n\r\nLast week the group released the second incarnation of the website which is the catalyst to revitalise the group and plan for the future.\r\n\r\nIf you\'re in the Midlands area and interested in joining the Multipack, then just come along, share your ideas andperhaps learn something new. We meet up **every second Saturday** at 2pm in Birmingham.', '0', '0'),
(18, 1, 1, 1, '2007-10-31 10:26:11', '2007-10-31 10:30:59', 'RSS Feeds', 'rss-feeds/', 'You may have heard of something called RSS feeds, but are unsure what they\'re for, why they\'re important or even how you\'re supposed to use them.', 'RSS feeds are a technology you may have heard of, but are unsure what it actually means. RSS is the most well know type of **web feed**, but there is another flavour called Atom.\r\n\r\n[Our web packages](/services/websites/) automatically create both types of web feeds for your news. This means your customers can keep track of your updates automatically.', '0', '0'),
(19, 2, 1, 1, '2007-11-01 10:51:34', '2007-11-06 09:10:33', 'Winning Business', 'winning-business/', 'Drop into the Winning Business Think Local Exhibition 2007 at Drayton Manor Theme Park on Tuesday 6th November between\n8.00am and 5.00pm – the area\'s largest business exhibition. Entry is free and you will get the opportunity to meet\nhundreds of local business leaders.', 'If you are free for an hour or two on Tuesday 6th November you may like to drop into the *Winning Business Think Local Exhibition 2007* at Drayton Manor Theme Park – the area\'s largest business exhibition. Entry is free and you will get the opportunity to meet hundreds of local business leaders.  \n\nThe Winning Business exhibition is open from 8.00am until 5.00pm and takes place in the Ballroom, Lounge, Hamilton Suite and Missanda Suite with over 100 top businesses represented. Creation are sharing stand 83 with Chase Promotions in the Ballroom if you would like to drop by and see us and find out more about our design and web development services.\n\nA *Winning Business Think Local Exhibition 2007* catalogue will be available to you on the day containing details of all the exhibitors. There are also free business skills and training workshops and of course the opportunity to network with hundreds of other local businesses.\n\nThe whole event has been organised by Think Local, East Staffordshire Borough Council, Lichfield District Council, Tamworth Borough Council and Staffordshire Chamber of Commerce & Industry. Representatives from them all will be on hand during the day to offer expert help and advice for companies looking to develop their marketing effectiveness and tackle other key issues affecting their business.\n\nSee you there!', '1', '1'),
(20, 1, 3, 3, '2007-11-01 15:17:58', '2007-11-01 18:26:17', 'Earn Some Extra Cash', 'earn-some-extra-cash/', 'Earn 5% commission on referrals for twelve months.', 'Do you know anyone who would be interested in buy design, print or web work? If so, put them in touch with us and you will receive 5% commission on their total design fees for the following twelve months.', '0', '0'),
(21, 1, 1, 3, '2007-11-01 15:25:39', '2007-11-01 16:30:16', 'Think Local \'07', 'think-local-07/', 'Creation have a stand at the Winning Business Think Local \'07.', 'Creation have a stand at the Winning Business Think Local \'07 show at Drayton Manor Theme Park, near Tamworth on Tuesday 6th November. Come along any time between 8am & 5pm and find out what Creation can do for you.', '0', '0');
