(22, 2, 2, 1, '2007-11-18 19:29:13', '2007-11-18 19:29:13', '', '/', '', 'Christmas e-shot offer\n\nNow\'s the time to be getting your Christmas card list together and getting your Christmas cards designed and printed. Of course, this is something we could arrange for you. But there is another option available to you either as an alternative to Christmas cards or as an addition to promote awareness – a designed Christmas e-shot.\n\nIf you are not sure, an e-shot is the electronic equivalent of direct mail (or a Christmas card), sent and received as an email. So when you receive an email containing pictures and graphics which may even look like a website, that\'s an e-shot. Recipients of an e-shot are usually your current customers or anyone who has requested regular updates. An e-shot can take many forms, perhaps a simple news bulletin, seasonal greetings, a marketing message or a more detailed e-zine type e-newsletter. The advantages of using this medium to contact your customers are the speed a campaign can be created, the cost effectiveness and the ability to monitor the success of your campaign.\n\nWe have developed a low cost offer to allow everyone to send a Christmas e-shot for only £197. Simply choose from one of the three e-shot designs, supply us with your text, logo and list of up to 500 recipients and we\'ll do the rest. Once the campaign has been sent you will be given access to your own online area to check and monitor your campaign statistics. If you would like to increase the number of recipients we can do that for you too for marginal cost. We can also customise the standard e-shots designs a little or even create your very own totally custom design from £595.\n\nSo – you could replace your current Christmas card routine with our Christmas e-shot and save money on design, printing, packing and postage. As well as reducing your carbon footprint. Or send out a Christmas e-shot as and addition to tell your customers about Christmas opening and closing times, other seasonal variations in service or even special offers. Then for just an extra £45 we could resend the same campaign for you to make sure everyone has seen and noted the content.\n\nThe whole thing could be turned around within 24 hours for you, so none of those last minute panics.\n\nYou can email or call me on 01785 716136 if you would like to find out more about Christmas e-shot design or anything else to do with e-marketing.', '0', '0'),
