(30, 2, 3, 1, '2008-01-22 12:33:48', '2008-01-31 11:08:21', 'Helvetica The Movie', 'helvetica-the-movie/', 'Helvetica is a feature-length independent film by Gary Hustwit about the font itself, typography, graphic design and global\r\nvisual culture. It explores how, over the last 50 years, Helvetica has touched every part of our lives and how it has\r\nbecome\r\na ubiquitous design icon.', '[*Helvetica*](http://www.helveticafilm.com) is a feature-length independent film by Gary Hustwit about the font itself, typography, graphic design and global visual culture. It explores how, over the last 50 years, Helvetica has touched every part of our lives and how it has become a ubiquitous design icon.\r\n\r\nThe film contains interviews and opinion from many of the calligraphers, typographers and designers who have been involved with the creation of, use of and rebellion against Helvetica.\r\n\r\n[My review](/company/leigh-scott/)\r\n\r\n> Thoroughly enjoyed the film and all the extra interview material. It was a rare opportunity to hear what generations of typographers and designers think of Helvetica and how they see its role. Eric Spiekermann, Matthew Carter and of course the legendary Hermann Zapf were truly inspiring. \r\n\r\n> I love Helvetica. It is such a versatile font family but I can see the need to express personality through typography and therefore, the necessity to choose appropriate fonts and encourage new type design. The big questions are will there be another Helvetica and will there be a sequel to this movie?\r\n\r\n[Trevor\'s review](/company/trevor-morris/)\r\n\r\n> As a web developer I do not interact with different fonts on a daily basis, however, I do appreciate good typography. This film was a good introduction in to the most important typeface in todays society. The film follows the timeline of the font, from it\'s inception 50 years ago, through a rebellion period and emerging as the \'defecto\' font in everyday society (whether you realise it or not!).\r\n\r\n> I felt some parts of the film put too much emphasis on the importance of the font in relation to globalisation, commercialism and politics – even relating the font to the Vietnam war and the current invasion of Iraq. However, the segments by [Erik Spiekermann](http://www.spiekermann.com), [Experimental Jetset](http://www.experimentaljetset.nl) and [Michael C. Place](http://wearebuild.com) were interesting and educational without being pretentious.\r\n\r\n> The film is well shot and the cinematography of the stills which artfully reveal the use of the font all around us are beautiful.\r\n\r\n\r\nMore information about the film is available at [helveticafilm.com](http://www.helveticafilm.com)', '1', '1'),
(31, 4, 4, 1, '2008-04-14 14:02:05', '2008-04-15 11:50:55', 'New Agila launch', 'new-agila-launch/', 'Vauxhall have now successfully launched the New Agila replacing the outgoing model. We are proud to have been selected by\r\nVauxhall to design and produce the press kit to accompany the launch. The launch event was a great success. We are now just\r\nwaiting to spot the first one on the road. No prizes though I\'m afraid.', 'Vauxhall have now successfully launched the *[New Agila](http://www.newagila.co.uk)* replacing the outgoing model. We are proud to have been selected by Vauxhall to design and produce the press kit to accompany the launch. The launch event was a great success. We are now just waiting to spot the first one on the road. No prizes though I\'m afraid.\r\n\r\nThe New Agila is smart and sexy – the ideal urban runaround. It\'s small enough to fit into the tightest of spaces yet spacious enough to seat five people and their luggage. It is aimed at a slightly different, mainly female, market and with this in mind we came up with the concept of a fashion conscious woman\'s magazine for the basis of the press kit.\r\n\r\nThe size, styling and spoof ads inside all contributed to the look and feel we were after. The whole thing, including the CD which was cleverly held on the inside cover, was then sealed in a glossy film sleeve to finish it off.\r\n\r\nThe launch team were very pleased with the finished result and everyone at Creation is looking forward to coming up with more creative solutions for Vauxhall.', '1', '1'),
(32, 1, 1, 1, '2008-04-24 11:02:16', '2008-04-24 11:16:54', 'Future of Web Design \'08', 'future-of-web-design-08/', 'Future of Web Design is a conference aimed at web developers and designers, which looks at current trends in web development\r\nand association with other media, such as art and movies and tries to predict where the Web is going in the future.', '2008 is the second year the [Future of Web Design](http://www.futureofwebdesign.com) conference has been held. After coming away last year with inspiration and a renewed sense of enthusiasm for the Web, I decided to attend again this year – I also dragged [my boss](/company/leigh-scott/ \'Leigh Scott\') along to see what the fuss was about. \r\n\r\nFOWD looks at current trends in web development and their association with other media, such as fine art, and tries to predict where the Web is going in the future. It\'s a conference aimed at the web standards crowd, including both designers and developers – as a developer, I\'m always inspired by great design, and this conference has some great examples.\r\n\r\nPatrick McNeil from [Design Meltdown](http://www.designmeltdown.com \'Design Elements, Trends & Problems in Web Design\') presented \"Finding Inspiration For Design\" which talked about using inspiration from direct sources, such as fine art, billboards and commercials. Examples were shown which draw the user in to the website with cut-out style pictures that invade the user\'s phyiscal space. Patrick also talked about current trends such as the colour brown and super-sized text. He briefly talked about potential future trends. He mentioned the use of pastel colours, which I agree with, but I don\'t think horizontal-scrolling websites and video-heavy websites will be globally successful, but will work in some niche markets – especially in marketing and design portfolio websites.\r\n\r\n[Andy Clarke](http://www.stuffandnonsense.co.uk \'Stuff & Nonsense\') & [Steve Pearce](http://www.pokelondon.com \'Poke\') debated whether \'User Experience\' and \'Brand Experience\' had to be mutally exclusive. I didn\'t really get much out of this segment and it didn\'t seem very well polished. However, Steve\'s slides were extremely cute and unique. [Jeremy Keith sums up Steve\'s presentation very well saying](http://adactio.com/journal/1439/ \'\"User Experience vs. Brand Experience\" review by Jeremy Keith\'):\r\n\r\n> **An experience iceberg**. The visual part sits above the surface (what most people see) but the main part (that people interact with) is below the surface. We spend too long focusing on the bit above the surface. It doesn’t matter how much you polish the visible bit if it’s a wreck underneath. Basically, you can’t polish a turd …or a turdy iceberg. Instead we should work on the experience, which is the stuff under the surface. The reason we should work on this is that users will spread the word about good and bad experiences.\r\n\r\n[Andy Budd](http://andybudd.com) talked more about user experience with his presentation entitled \"Designing the User Experience Curve\". Andy\'s talk was an interesting insight in to the minds of users, and how they not only compare your website\'s experience to other websites they\'ve used, but also to real-world scenarios. Andy talked about the *attention to detail*, user feedback and making the experience fun. Users remember details and often mention them if they talk (promote) your product or service. Real-world examples include good concierge service and a Innocent Smoothie making you smile with the words \"Stop looking at my bottom\" on the underside of the carton. [Moo](http://www.moo.com \'We love to print\'), a printing company, has this attention to detail – they use quirky personalities in their automated emails – users remember good details and recommend such services, like I\'ve just done!\r\n\r\n[Elliot Jay Stocks](http://elliotjaystocks.com) talked on \"Print is the new web\", making comparisons between what is available for the print industry (white-space, unusual layouts and breaking grid systems) and what is limited on the web. Also comparing the different styles employed in Flash design to HTML/CSS and that each industry should beinfluenced by each other.\r\n\r\n[Jon Hicks](http://hicksdesign.co.uk \'hicksdesign: design for print and new-fangled media\'), who doesn\'t want to be famous for designing the Firefox logo, walked through building a basic website from scratch in to a workable template using HTML and CSS in his presentation \"From Design to Deployment\". I felt this presentation was a little out of sync with the rest of the day, being more practical than design theory. However, I learned a couple of gems which I will now apply to my web development. A tip I\'d like to pass on is: use both the full name and PostScript name of your fonts to make sure the font will work in both Safari and Firefox – [Guillermo Esteves](http://gesteves.com/posts/247 \'Helvetica Neue Light\') has more information about this.\r\n\r\n[Paul Farnell](http://litmusapp.com \'Litmus: Painlessly test your email and website designs\') went through some of the \"Unconventional ways to promote your site\" with experience and examples from promoting his web application. This was the first time I\'ve seen Paul speak and he communicated his ideas very well. Most of the tips can be applied to every website you build, and so this was a very useful presentation.\r\n\r\n[Daniel Burka](http://deltatangobravo.com) who works on two large community-based websites, [Digg](http://digg.com) and [Pownce](http://pownce.com \'Send stuff to your friends\'), presented \"Evolving the User Experience\", continuing the theme of the day. Many of the things Daniel talked about, such as iteration and community feedback were very useful and insightful because of the community applications he works on. However, I do not think this was the correct target audience for this information as I doubt the majority of people have the traffic, scaling issues and community of these sites. This was an interesting talk but I felt nothing which was really of use for me.\r\n\r\n* * *\r\nOverall, like last year, although I didn\'t necessarily learn a lot, I came away from the conference with a renewed passion for the Web, and couldn\'t wait to get back to a computer and start tinkering with ideas which welled up throughout the day.\r\n\r\nGoing to conferences is a great way to rejuvenate interest and interact with enthusastic colleagues. I always come away with at least one new idea I think could work and this time was no exception.', '1', '1');
