INSERT INTO `page_details` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Position`, `TabName`, `TabURL`, `Title`, `Text`, `Active`) VALUES
(1, 1, 1, '2007-02-05 09:50:05', '2007-02-05 09:50:05', 1, 'Company', '/company/', 'About the Company', '**Creation are a team of specialist graphic designers and web developers offering both design for print and web design consultancy services,\r\nbased in Staffordshire, UK. In addition you will find on offer a growing number of customer focused fixed price packages and solutions.**\r\n\r\nOur work is both innovative and creative, delivering quality solutions for all marketing communications both in print and online. Take advantage of our years of expertise in a number of market sectors and allow us to  demonstrate the range of skills and techniques available to you. You can see in the portfolio the broad range of projects we undertake including corporate styling, business literature, advertising, direct mail, exhibitions, and websites.\r\n\r\nOur clients are all friendly, approachable people who appreciate the role quality design plays in successful marketing. You too can build a relationship with us to provide a full, seamless service for all your marketing and promotional material.\r\n\r\nIf you would like to find out more about how you can benefit from world class design, please get in touch. Call **01785 716136** or email [leigh@creation.uk.com](mailto:leigh@creation.uk.com)', '1'),
(2, 1, 1, '2007-06-20 14:38:48', '2007-06-20 14:38:48', 2, 'Eshots', '/eshots/', 'Eshots', '###Eshots *Email Campaigns*###\r\n\r\nEshots are HTML Emails used to market your company. HTML Emails have become one of the biggest forms of direct communication within the sales and marketing environment over the past few years. Used in conjunction with an up-to-date database, it can become one of the most useful and effective tools within your marketing mix, bringing measurable Return On Investment (ROI) for a relatively low cost.\r\n\r\nYou can browse through our Eshot campaigns or if you wish to setup your own Eshot please [contact us](/contact/) and we\'ll be happy to help.', '1');
INSERT INTO `portfolio_category` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Category`, `Safe_URL`, `Landing`, `TaglineHeading`, `Tagline`) VALUES
(1, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Advertising', 'advertising/', '0', '###The strategy *is all*###', 'The successful ad or promo piece depends on a solid idea borne of a sound strategy. Focus on a single message and get the balance of information right. Take it too far and the final impact, and therefore the opportunity, is lost.'),
(2, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Branding', 'branding/', '0', '###Your brand *is unique*###', 'In this age of consumerism a solid brand identity is essential, it\'s at the core of what you do, it\'s an expression of your ideals, it\'s how you are judged. There is no more important design consideration.'),
(3, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Concepts', 'concepts/', '0', '###Driven *by creativity*###', 'The freedom to think and build a creative solution for you is what drives us. Each project is like a new, exciting journey to us. Sometimes along familiar roads, other times exploring new worlds.'),
(4, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Print', 'print/', '1', '###Creating *something beautiful*###', 'Even after years of designing, there is nothing more rewarding than seeing a finished job in print. It\'s the proof of everyone\'s effort, a work of commercial art immortalised forever.'),
(5, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Display', 'display/', '0', '###Making *it work*###', 'Get it right and your display material will knock \'em dead. Get it wrong and they won\'t even notice your presence. The audience and the local environment play the key roles in design for display.'),
(6, 1, 1, '2006-10-09 12:56:29', '2006-10-09 12:56:29', 'Websites', 'websites/', '0', '###The future *is here*###', 'The potential for developing your business online is constantly growing. Here lies the future of mass communication and collaboration. Let us guide you through the possibilities and help you harness new ideas and technology.');
