INSERT INTO `portfolio_details` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Portfolio_Category_ID`, `Portfolio_Company_ID`, `Title`, `Safe_URL`, `Summary`, `Description`, `Website`, `Active`, `Landing`) VALUES
(20, 1, 1, '2007-02-06 10:06:41', '2007-02-06 10:06:41', 1, 21, 'Keycom Posters', 'keycom-posters/', 'Posters to promote new services and special offers.', 'Just two of many posters for Keycom publicising new services, price changes or special offers. Often produced on very tight deadlines. An original design was done first then alternatives were completed for different offers or updates to service information.', NULL, '1', '0'),
(21, 1, 1, '2007-02-06 10:06:41', '2007-02-06 10:06:41', 1, 55, 'VXRacing Postcard', 'vxracing-postcard/', 'Promotional driver autograph cards to give away.', 'Part of the set of promotional items for the BTCC VXRacing team. Drivers information cards are produced mainly to sign and give away to fans. The nature of this type of project usually means a significant amount of photoshop work is done to tweak vehicle livery details and create the final images.', NULL, '1', '0'),
(19, 1, 1, '2007-02-06 10:00:06', '2007-02-06 10:00:06', 6, 57, 'Coachline Website', 'coachline-website/', 'A custom built website to request insurance quotes.', 'A site created to allow customers to request an insurance quote for commercial vehicles. A relatively simple overall concept with minimal information and straight forward functionality. The look and feel of this site led to similar treatments on direct mail pieces. ', '', '1', '0'),
(18, 1, 1, '2007-02-06 10:00:06', '2007-02-06 10:00:06', 6, 7, 'Nexus Website', 'nexus-website/', 'A powerful website for TV mount retailers and customers.', 'The website of one of the world\'s leading manufacturers of TV wall mounts, AVF. This custom built site was developed following the Nexus brand development to highlight the new range of LCD and plasma mounts in addition to the main site. Product information and compatibility guides offer information for both trade customers and end users.', '', '1', '0'),
(17, 1, 1, '2007-02-02 09:53:58', '2007-02-02 09:53:58', 3, 56, 'Umbria Trail Tours', 'umbria-trail-tours/', 'An insight into the early stages of design.', 'Some projects start their lives in a very different way to the way they end up. Generally the initial ideas or early stages of design are never seen by anyone not involved directly with the project. We thought you would be interested to see some examples. This was an initial concept for a promotional leaflet for Umbria trail tours.', NULL, '1', '0'),
(12, 1, 1, '2007-02-01 17:21:38', '2007-02-01 17:21:38', 4, 29, 'Full Time Course Guide', 'full-time-course-guide/', 'Student facing printed guide, an A4 40pp publication.', 'We have worked closely with the team from Tamworth and Lichfield College for a number of years. Over time we have managed to fine tune their design for print requirements both saving money and improving the quality of their publications. Each year the Full-time guide is the College\'s flag ship piece of marketing material, setting the scene for the next wave of style changes. All elements of design, photography and print are arranged for the College to create a seemless service.', 'http://www.tlc.ac.uk', '1', '0'),
(13, 1, 1, '2007-02-01 17:21:38', '2007-02-01 17:21:38', 4, 27, 'International Students Guide', 'international-students-guide/', 'An A4 28pp guide distributed to potential overseas students.', 'Kingston College have benefited from our experience in design for the education market. The International students guide is one of many publications brought together by their distinctive styling. Each year the brief and requirements alter to meet the ever changing student market. Always we are able to provide the most efficient service and offer the best design and print solutions.', NULL, '1', '0'),
(14, 1, 1, '2007-02-01 18:02:58', '2007-02-01 18:02:58', 5, 55, 'Xplod Car Livery', 'xplod-car-livery/', 'Graphics for promotional vehicle loaded with entertainment equipment.', 'Creative solutions for vehicle liveries are realised using Photoshop. We can explore multiple options before the real thing exists to get client approval. This is a Sony promotional vehicle kitted out with the very latest Xplod in-car entertainment systems. The final versions of the car were created using metallic and conventional cut vinyl. Complete vehicle wraps can be used for even more creative liveries.', NULL, '1', '0'),
(15, 1, 1, '2007-02-01 18:02:58', '2007-02-01 18:02:58', 5, 55, 'Roller Banner Stands', 'roller-banner-stands/', 'Product display banners for show use nationally.', 'Roller banner stands are a very cost effective solution for a multitude of uses. These, created for Sony, were used to promote their Xplod range of in-car entertainment systems at various shows. The beauty of these stands is the simplicity of the design solution. Strong imagery often speaks louder than words.', NULL, '1', '0'),
(16, 1, 1, '2007-02-02 09:53:58', '2007-02-02 09:53:58', 3, 56, 'Minesweeper', 'minesweeper/', 'An exploration of creative ideas and techniques.', 'An experimental piece created by Tim using Lightwave and Photoshop. These concepts are sometimes used in live jobs as the basis for background and supporting images. If you have visited the studio you may have seen a triptych on the wall based on this concept.', NULL, '1', '0'),
(10, 1, 1, '2007-01-30 17:17:27', '2007-01-30 17:17:27', 2, 53, 'Logo Design', 'logo-design/', 'A new logo design for a new recruitment company.', 'As well as the website Phoenix needed to create their own CI. A few ideas were submitted and this was the final choice. A simple, classically styled answer to the brief, creating a very professional style to apply to the website.', 'http://www.phoenixemployment.uk.com', '1', '0'),
(11, 1, 1, '2007-02-01 16:15:59', '2007-02-01 16:15:59', 2, 54, 'Product Branding', 'product-branding/', 'New identities for a range of software products for schools.', 'Many of our clients need new or updated product branding. TASC Software produce packages designed for use in schools and needed to update their package branding to reflect the high quality of the products and associated services. The new branding first saw the light of day on a pop-up display solution.', NULL, '1', '0'),
(22, 1, 1, '2007-03-14 10:02:18', '2007-03-14 10:02:18', 6, 1, 'Ady Smith Website', 'ady-smith-website/', 'Promotional site for off road motorcycling schools.', 'Multiple title winning enduro and supermoto rider, Ady Smith, now offers off road and supermoto schools to everyone. The site follows styling developed by us for stationery and promotional leaflets. The Content Management System (CMS) allows Ady to change and update all text and pictures on the site. This is one of our [GoLive website packages](/services/websites/golive/) starting at only £795.', 'http://www.adysmith.co.uk', '1', '0'),
(23, 1, 1, '2007-03-23 10:33:24', '2007-03-23 10:33:24', 6, 58, 'F1 Events Website', 'f1-events-website/', 'Promoting F1 driving simulators for corporate events.', 'Full size, carbon fibre F1 car replicas kitted out with consoles and LCD TVs for corporate events. The site has been designed to follow the corporate styling and is fully enabled with a Content Management System (CMS), allowing anyone with admin access to change the site content. This is one of our [GoActive website packages](/services/websites/goactive/) starting at £1995.', 'http://www.f1events.co.uk', '1', '0'),
(24, 1, 1, '2007-03-23 10:33:24', '2007-03-23 10:33:24', 6, 59, 'Classic Car Journeys Website', 'classic-car-journeys-website/', 'An opportunity to find out about car rallies abroad.', 'A new venture offering driving holidays to car enthusiasts. The site contains a wealth of information about the trip, with a gallery, news section, downloads, links, FAQs. The site has been designed to follow the corporate styling and is fully enabled with a Content Management System (CMS), allowing anyone with admin access to change the site content. This is one of our fully functional [GoActivePro website packages](/services/websites/goactivepro/) starting at £3495. ', 'http://www.classiccarjourneys.co.uk', '1', '0'),
(25, 1, 1, '2007-03-23 10:36:13', '2007-03-23 10:36:13', 6, 60, 'Martin Webley Website', 'martin-webley-website/', 'Marketing tool for this independent driving instructor.', 'An entry level solution for a local, highly qualified driving instructor. The style fits in with the new CI implemented by us. The Content Management System (CMS) allows Martin to change and update all text and pictures on the site. A great example of an economic solution to creating and maintaining a web prescence. This is one of our [GoLive website packages](/services/websites/golive/) starting at only £795.', 'http://www.martinwebley.co.uk', '1', '0'),
(26, 1, 1, '2007-03-23 10:36:13', '2007-03-23 10:36:13', 6, 58, 'ID PR Website', 'ip-pr-website/', 'Main Website for PR and marketing specialists.', 'A forward looking specialist PR and marketing company with a UK and worldwide client base. A clean and simple site to promote the range of services on offer. The site has been designed to follow the corporate styling and is fully enabled with a Content Management System (CMS), allowing anyone with admin access to change the site content. This is one of our [GoActive website packages](/services/websites/goactive/) starting at £1995. ', 'http://www.id-pr.co.uk', '0', '0'),
(27, 1, 1, '2007-06-08 16:50:31', '2007-06-08 16:50:31', 2, 61, 'The Fruit Box Co. Logos', 'the-fruit-box-co-logos/', 'New ID for a boxed fruit delivery company.', 'This is new venture, delivering boxed fruit to London based customers. A healthy and popular choice for any business to offer both employees and clients fresh fruit in the workplace. All of the presented ideas are shown, the first being the one they settled on.', NULL, '1', '0'),
(28, 1, 1, '2007-06-08 16:50:31', '2007-06-08 16:50:31', 5, 7, 'Comet Touchscreens', 'comet-touchscreens/', 'Instore product information touchscreen development.', 'The existing data and website structure of the AVF Nexus site gave us the perfect foundation to create a touchscreen environment for instore customers to select a TV wall mount. These prototype environments are loaded on to all-in-one PC and monitor units for easy of installation. With a permanent broadband connection, updates to the data can be made at any time and appear on all touchscreens. This example is shown with a simple screen surround to give the customer more information and fit in with the display graphics.', NULL, '1', '0'),
(29, 1, 1, '2007-06-08 16:51:02', '2007-06-08 16:51:02', 3, 62, 'GMC Today Newsletter', 'gmc-today-newsletter/', 'Design concepts for new business presentation.', 'When the need arises, we are given the opportunity to come up with design ideas with very few constraints. In this example we took the existing GMC newsletter and improved the look and feel in every area, to show what could be done. The final visuals were used in XGS presentations for generating new business.', NULL, '1', '0'),
(32, 1, 1, '2007-06-27 13:11:40', '2007-06-27 13:11:40', 6, 63, 'Instant Training Website', 'instant-training-website/', 'A full e-commerce website for training courses.', 'The new website for one of the leading suppliers of safety training, including access equipment, plant and health & safety. The custom built site has stretched the facilities offered online to customers. They can now book and pay for courses on line and keep up to date with the site\'s ever changing content. Site page content, news, links, courses and course dates are maintained and updated in the password protected admin area.', 'http://www.instant-training.com', '1', '0'),
(33, 1, 1, '2007-08-13 17:30:51', '2007-08-13 17:30:51', 4, 15, 'Structal Brochure', 'structal-brochure/', 'Project portfolio 28pp, aimed at architects.', 'Another portfolio style brochure for Structal UK, the UK arm of international curtain walling company Rinaldi Structal. This brochure follows on from a range of other portfolios and presentation folders designed by us showcasing recent and up and coming projects. This latest portfolio consists of a brief description, photographs and 3D renders of mullions created by us. The brochure is finished using gloss lamination, spot UV and a fifth spot colour.', NULL, '1', '0'),
(34, 1, 1, '2007-08-13 17:30:51', '2007-08-13 17:30:51', 4, 36, 'Rojac Brochure', 'rojac-brochure/', '295mm square 12pp promotional brochure.', 'Promotional brochure for Rojac Tooling Technologies outlining their core areas of business and how they utilise the latest techniques and technology. The brochure is a dominating size, 295 x 295mm, to reflect the scale and importance of some of the high profile engineering projects Rojac undertake. The new ID and promotional items have helped them break into the aerospace sector. This is just one of many projects we have worked on for Rojac. They include the corporate ID, newsletters, advertising, websites, exhibitions and presentations.', 'http://www.rojac.com', '1', '0'),
(35, 1, 1, '2007-08-14 17:44:52', '2007-08-14 17:44:52', 6, 29, 'Tamworth & Lichfield College Website', 'tamworth-lichfield-college-website/', 'College website with powerful features.', 'The website for Tamworth & Lichfield College, a college with a real dedication to embracing new technology and improving the student experience. The site has many powerful features including content and course management, course searches, mypage personal timetable with diary, media centre, latest news and minisite creator. This is all controlled in a comprehensive, password protected administration area.', 'http://www.tlc.ac.uk', '1', '0'),
(36, 1, 1, '2008-04-14 16:17:11', '2008-04-14 16:17:11', 4, 5, 'Agila Press Kit', 'agila-press-kit/', 'Press kit for New Agila model media launch.', 'Vauxhall are a new client for us and this new project has been a joy to work on, considering our passion for all things automotive. The brief was for a press kit to accompany the launch of the all-New Agila. With the new market in mind we came up with the concept of a fashion conscious woman\'s magazine for the basis of the press kit. The size, styling and spoof ads inside all contributed to the look and feel we were after. The whole thing, including the CD which was cleverly held on the inside cover, was then sealed in a glossy film sleeve to finish it off.', 'http://www.newagila.co.uk', '1', '1');
