INSERT INTO `services_details` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Services_Category_ID`, `Title`, `Safe_URL`, `Type`, `Summary`, `Description`, `Price`, `Active`, `Position`) VALUES
(1, 1, 1, '2007-02-02 14:33:42', '2007-02-02 14:33:42', 6, 'Web design & development', 'web-design-development/', 'introduction', 'A more creative approach to online design solutions.', 'You can be confident in our design for web and web development skills. The team live and breathe online culture and are fully aware of new developments in web technology and will guide you in the right direction. You can rely on our recognised development ability to provide the very best online solutions. All sites are designed with accessibility in mind and follow W3C Web Content Accessibility Guidelines (WCAG) to open your site up to all users as well as being fully search engine optimised. Many happy \r\ncustomers are evidence of our website services\r\n\r\nAs part of our design consultancy offering in this area of expertise, choose from the following customer focussed services, packages and solutions.\r\n\r\n**FREE initial consultation**  \r\nAllow our team to visit you, find out about your business and your customers, then make recommendations on how your business can grow with our creative input.\r\n\r\n**Website audit and proposals**  \r\nEngage with members of our web development team to evaluate your existing website strategy and any existing site. Your site will be checked for accessibility and search engine optimisation.\r\n\r\n**Usability studies**  \r\nMonitor how users interact with your existing website and allow us to prepare proposals for improvements and new development. Usually conducted as one-to-one sessions over a number of days.\r\n\r\n**Design and development**  \r\nSee how our web design and development team can turn ideas into reality. There really is no limit to the team\'s capabilities they all love a new challenge.\r\n\r\n**Design only**  \r\nTake advantage of our \'design only\' service if you already have in-house developers. You will still receive the utmost attention and benefit from the skill of our world class design team.\r\n\r\n**FREE web information sheets and links**  \r\nChoose from a selection of web related information sheets and links to help you understand the terminology and keep up-to date with new technology.\r\n\r\n**WEBSITE PACKAGES AND SOLUTIONS**  \r\nA number of web packages and solutions have been developed to make it even easier to get your first website up and running and work online. Take a look.', 0, '1', 1),
(2, 1, 1, '2007-02-02 15:15:07', '2007-02-02 15:15:07', 6, 'GoLive', 'golive/', 'website', 'For anyone who needs a simple, easy-to-update web presence.', 'This entry level website is a simple and easy-to-use solution for small businesses and individuals. Choose one of three site styles ready for your logo and corporate colours to be integrated into the design. Create up to seven, content managed pages. Content management allows you to edit each page yourself, adding text and pictures in a password protected administration area. It could not be easier.', 795, '1', 2),
(3, 1, 1, '2007-02-02 15:15:07', '2007-02-02 15:15:07', 6, 'GoActive', 'goactive/', 'website', 'For anyone who needs a fully designed, simple, easy-to-update site.', 'The GoActive website offers a more comprehensive, fully designed solution for small businesses and individuals. The look and feel of the site is designed to fit in with your corporate styling. Create up to thirteen, content managed pages. Content management allows you to edit each page yourself, adding text and pictures in a password protected administration area. It could not be easier. Three information modules are also included to allow a sidebar to be added, a contact/enquiry panel and address details.', 1995, '1', 3),
(4, 1, 1, '2007-02-02 15:15:41', '2007-02-02 15:15:41', 6, 'GoActive Plus', 'goactive-plus/', 'website', 'Upgrade your GoActive website with extra modules.', 'Choose from the modules list below to upgrade your GoActive website. If you wish to take all of these upgrades choose the GoActivePro website — they\'re all included as standard **SAVING YOU £450.**\r\n\r\nChoose the upgrade you would like and add the costs to the £1995 GoActive website price.\r\n\r\n**Gallery module** — Add, manage and delete pictures and captions appearing on your gallery/portfolio page. Create a maximum of six categories containing up to six images and captions in each, thirty-six in total. Users choose a category, a thumbnail is displayed which, when clicked, reveals a larger image.  \r\n**ADD £395 + £10 to hosting charge**\r\n\r\n**News module** — Add, manage and delete news articles and pictures to appear on your own news page. Site visitors can utilise RSS feeds to link your news articles to their news aggregators. Users see latest article displayed first, then click archive tab to reveal a list of previous articles arranged by month.  \r\n**ADD £395 + £10 to hosting charge**\r\n\r\n**Downloads module** — Download and manage a maximum of twelve files (e.g. pdf, word, images etc) with a title and description. Then either create a downloads page or add links to the files from existing pages. Users visit the download page or any other page and click a link to download a file.  \r\n**ADD £395 + £10 to hosting charge**\r\n\r\n**Links module** — Add, manage and delete internal or external links with descriptions appearing on your links page. Create a maximum of six categories containing unlimited links and descriptions. Users choose a category, the list of links with a brief description is displayed, click to follow the link.  \r\n**ADD £245 + £10 to hosting charge**\r\n\r\n**FAQs module** — Add, manage and delete Frequently Asked Questions and answers about your company, product and/or services. Create a maximum of twelve question and answer combinations. Users click on the question on the FAQ page to reveal the answer below.  \r\n**ADD £245 + £10 to hosting charge**\r\n\r\n**Human Resources** — Add, manage and delete details of up to six staff. Include name, phone, fax, email, description and even include a photograph. Use these details to create your own contact page, perhaps with the contact form and address too. Users will see the contact details of all staff added.  \r\n**ADD £245 + £10 to hosting charge**', 0, '1', 4),
(10, 1, 1, '2007-02-26 14:21:31', '2007-02-26 14:21:31', 6, 'GoActivePro', 'goactivepro/', 'website', 'For anyone who needs a fully designed, fully functional, easy-to-update professional site.', 'The GoActive website offers a comprehensive, fully designed solution for small businesses and individuals. The look and feel of the site is designed to fit in with your corporate styling. Create up to thirteen, content managed pages. Content management allows you to edit each page yourself, adding text and pictures in a password protected administration area. Three information modules are included as well as six functionality modules allowing control over masses of extra information, images and files.', 3495, '1', 5),
(5, 1, 1, '2007-02-02 15:25:31', '2007-02-02 15:25:31', 4, 'Graphic design & print', 'graphic-design-print/', 'introduction', 'The source for all your creative solutions for print.', 'Draw on our vast experience in design for print across a wide range of sectors. Your customers first impression of your business depends on the way it is presented in print and other media. Your printed literature, therefore, could be considered the cornerstone of your business image. The range of printed items you have to choose from is vast and we will always advise on the best, most cost effective solution. We have many happy customers who have benefited from our years of knowledge in this area.\r\n\r\nAs part of our design consultancy offering in this area of expertise, choose from the following customer focussed services, packages and solutions.\r\n\r\n**FREE initial consultation**  \r\nAllow our team to visit you, find out about your business and your customers, then make recommendations on how your business can grow with our creative input.\r\n\r\n**Design audit and proposals**  \r\nEngage with members of our team to evaluate your existing design strategy, formulate new proposals and execute new strategies to give you new direction.\r\n\r\n**Brainstorming sessions**  \r\nImmerse your marketing team with our creative minds in the \'Think Tank\' and see the ideas flow, and your business grow.\r\n\r\n**Customer focus groups and surveys**  \r\nCollect feedback and opinions from your customers or proposed customers through focus groups, telephone interviews or written/online surveys.\r\n\r\n**Design**  \r\nBenefit from world class creative design solutions and witness the passion and dedication of the whole team bringing ideas to life.\r\n\r\n**Training & seminars**  \r\nEducate your staff with on-site design training. Guidance on engaging with a design consultancy to make the relationship more effective or how to manage and execute a new marketing campaign.\r\n\r\n**FREE design information sheets**  \r\nDownload and use the selection of design related information sheets to guide you through areas like writing briefs and copy correction.\r\n\r\n**DESIGN PACKAGES AND SOLUTIONS**  \r\nA number of design packages have been created to keep things simple and offer you a selection of marketing tools at predictable prices. Take a look.', 0, '1', 1),
(6, 1, 1, '2007-02-02 16:24:04', '2007-02-02 16:24:04', 1, 'Direct marketing & advertising', 'direct-marketing-advertising/', 'introduction', 'Targeting your customers directly for maximum impact.', 'Talking directly to your customers is proven to be the most effective way to grow your business. Giving them the opportunity to respond, interact and comment is very important. You are entering into probably the most creative area of what we do, it is certainly one of the most enjoyable. Many advertising and mailer campaign ideas are borne of intense brainstorming sessions and the results are always a thrill because the means of communicating with customers are always changing and developing.\r\n\r\nAs part of our design consultancy offering in this area of expertise, choose from the following customer focussed services, packages and solutions.\r\n\r\n**FREE initial consultation**  \r\nAllow us to visit you and discuss your marketing objectives. From here we can advise on how to approach any direct marketing and advertising campaigns.\r\n\r\n**Direct marketing and advertising audit with proposals**  \r\nEngage with our creatives to look at existing or future marketing and advertising projects. We will detail proposals and guide you towards the best solutions.\r\n\r\n**Customer surveys**  \r\nUse focus groups, telephone interviews or written/online surveys to communicate with your customers and improve your marketing strategy. A multitude of solutions are available to suit your requirements and budgets.\r\n\r\n**DIRECT MARKETING AND ADVERTISING PACKAGES AND SOLUTIONS**  \r\nWe have created for you a very simple range of solutions to some key direct marketing and advertising needs. As all campaigns are very different you can use any of these elements and add any of our other services to create your ultimate campaign. Take a look.', 0, '1', 1),
(7, 1, 1, '2007-02-02 16:24:09', '2007-02-02 16:24:09', 2, 'Branding design & application', 'branding-design-application/', 'introduction', 'Creating your business brands.', 'Your Corporate Identity and Brand Identities are amongst the most important design considerations you can make. They are the foundation for all your design and marketing output. Effort spent at this stage will set the scene for your companies future image. A well designed CI will be distinctive and easy to use for years to come. The addition of a usage guide or full CI guide will mean anyone can successfully apply your CI and Brands to maintain continuity. The way you present yourself is a reflection on your business and how it works.\r\n\r\nAs part of our design consultancy offering in this area of expertise, choose from the following customer focussed services, packages and solutions.\r\n\r\n**FREE initial consultation**  \r\nAllow our team to visit you, find out about your business and your customers, then make recommendations on how your business can grow with our creative input.\r\n\r\n**CI and branding audit with proposals**  \r\nEngage with members of our design team to look at your proposed or existing CI and branding, we will then make recommendations and offer guidance on the next step.\r\n\r\n**BRANDING PACKAGES AND SOLUTIONS**  \r\nA carefully priced range of branding packages and solutions compiled to offer a variety of price points with and without usage guides. Take a look. For an entry level logo and stationery solution see the GetStarted package in the Graphic design & print section.', 0, '1', 1),
(8, 1, 1, '2007-02-02 16:24:18', '2007-02-02 16:24:18', 3, 'Your design consultancy', 'your-design-consultancy/', 'introduction', 'A consultancy with creative solutions to all your design problems.', 'Take advantage of years of experience in creative design for print and web across a number of sectors both nationally and internationally. Have total confidence in our ability — we are the authority on style and content for all your customer facing information. You can rely on us to understand both yours and your clients needs and always come up with a cost effective, creative formula to achieve your goals. Your sales will increase and your business will grow. Many of our clients have experienced this and understand the value of considered design.\r\n\r\nYour initial contact with us will take the form of a consultation to determine which of our services best suit your needs. You will find detailed descriptions of the specific services we offer on our website [www.creation.uk.com](http://www.creation.uk.com) and in various printed forms.\r\n\r\nYou will see there are two ways to take advantage of our design skills. Either by choosing to work with us in a consultancy capacity to receive tailored solutions, or by choosing from our range of customer focussed fixed priced and fixed specification packages and solutions. Whichever route you take, we guarantee the very best service and world class design and production.\r\n\r\nTake a look at the more detailed information in our areas of expertise and browse through our portfolio of work to see what we could do for you.', 0, '1', 1),
(9, 1, 1, '2007-02-02 16:24:27', '2007-02-02 16:24:27', 5, 'Display design & production', 'display-design-production/', 'introduction', 'A creative look at exhibition and display solutions.', 'Let us help you with your exhibition and display needs. The way you are presented at a show, instore or how your premises and vehicles look is crucial, your image in these environments is important to us and we make sure you create the right impression. You can take advantage of our experience and knowledge covering small banner stands, interactive instore displays, signage and vehicle liveries. Everything from off the shelf display products to totally customised solutions.\r\n\r\nAs part of our design consultancy offering in this area of expertise, choose from the following customer focussed services, packages and solutions.\r\n\r\n**FREE initial consultation**  \r\nAllow our team to visit you, find out about your business and your customers, then make recommendations on how your business can grow with our creative input.\r\n\r\n**Display audit and proposals**  \r\nEngage with members of our design team to evaluate your current display strategy and any existing display materials. Recommendations will be made and a new plan put in place.\r\n\r\n**Design only**  \r\nMake use of our \'design only\' service if you already have preferred suppliers for hardware production. You will still receive the best service and benefit from the skill of our world class design team.\r\n\r\n**FREE display information sheets**  \r\nTake a look at our selection of display related information sheets. You will get more of an idea of types of display equipment, sizes and technical details.\r\n\r\n**DISPLAY PACKAGES AND SOLUTIONS**  \r\nA selection of display packages and solutions have been developed to give you some tried and tested vehicles for your exhibition and display needs showing you what is available and what to budget for. Take a look.', 0, '1', 1),
(11, 1, 1, '2007-02-26 14:30:07', '2007-02-26 14:30:07', 6, 'GoSell', 'gosell/', 'website', 'For anyone who needs a fully designed, fully functional, easy-to-update, professional site with full Ecommerce facilities to sell online.', 'The GoSell website offers a comprehensive, fully designed solution for small businesses and individuals wanting to sell online. The look and feel of the site is designed to fit in with your corporate styling. Create up to thirteen, content managed pages. Content management allows you to edit each page yourself, adding text and pictures in a password protected administration area. Three information modules are included as well as six functionality modules allowing control over masses of extra information, images and files. Full Ecommerce functionality allows product management and selling.', 5495, '1', 6),
(12, 1, 1, '2007-02-26 15:29:37', '2007-02-26 15:29:37', 4, 'Logo & Stationery', 'logo-stationery/', 'new business identity package', 'Professionally designed logo and stationery for your new business.', 'This specially formulated package offers you the building blocks for your new business identity. A professionally designed logo, letterhead and business card. All high quality printed in full colour.', 995, '1', 2),
(13, 1, 1, '2007-02-26 15:29:37', '2007-02-26 15:29:37', 4, 'Leaflet', 'leaflet/', 'solution', 'Fold out A4 folded to DL leaflet.', 'An all in one deal price for your first promotional leaflet. Following on from your logo and stationery design and production, this package offers you an economic and tested marketing tool to promote your business and it\'s services.', 1295, '1', 3),
(14, 1, 1, '2007-02-26 15:32:04', '2007-02-26 15:32:04', 4, 'Folder', 'folder/', 'solution', 'Presentation folder with a pocket to hold A4 documents.', 'All in one deal price for your first presentation folder. To work alongside you corporate ID and other branded marketing material a slick presentation folder may be what you need to give to existing and prospective clients. Use for presenting quotes, proposals or as a way of keeping together product information sheets.', 1495, '1', 4),
(15, 1, 1, '2007-02-26 15:32:04', '2007-02-26 15:32:04', 4, 'Brochure', 'brochure/', 'solution', 'A slick corporate brochure or product catalogue.', 'Single package price for your brochure. To complete your marketing material a corporate brochure, product catalogue or guide may be the next step. The entry level option here offers the best balance of functionality and economy.', 2695, '1', 5),
(16, 1, 1, '2007-02-26 16:00:18', '2007-02-26 16:00:18', 2, 'Logo only branding', 'logo-only-branding/', 'solution', 'A professionally designed logo for your new business or brand.', 'The most cost effective solution to get a new business logo or a new brand identity in place. From your brief you will get three ideas to choose from then your final logo variations on CD all ready to use in print and on screen.', 695, '1', 2),
(17, 1, 1, '2007-02-26 16:00:18', '2007-02-26 16:00:18', 2, 'GetStarted', 'getstarted/', 'new business identity package', 'Professionally designed logo and stationery for your new business.', 'This specially formulated package offers you the building blocks for your new business identity. A professionally designed logo, letterhead and business card. All high quality printed in full colour.', 995, '1', 3),
(18, 1, 1, '2007-02-26 16:17:06', '2007-02-26 16:17:06', 2, 'Logo and usage guide', 'logo-and-usage-guide/', 'branding solution', 'A professionally designed logo for your new business or brand with full development, application examples and usage guide.', 'The serious approach for your new business logo or new brand identity. You will get three ideas to choose from then further development and examples of two applications are presented. Your final logo variations are supplied on CD all ready to use in print and on screen, with the addition of a PDF of your usage guide. The guide will indicate how to position your new logo, what size to use it and colour specifications for different media.', 1295, '1', 4),
(19, 1, 1, '2007-02-26 17:13:52', '2007-02-26 17:13:52', 2, 'Logo and CI guide', 'logo-and-ci-guide/', 'branding solution', 'A professionally designed logo for your new business or brand with full development, application examples and comprehensive CI guide.', 'The complete solution for your new business logo or new brand identity. You will get three ideas to choose from then further development and examples of multiple applications are presented to include in the CI guide. The guide will contain all the information needed by anyone applying your new CI or branding including logo explanations, logo positioning, logo placement, variation usage, colour specifications, corporate font usage, typography, stationery design and specification. Your final logo variations and CI guide are supplied on CD all ready to use in print and on screen.', 4495, '1', 5),
(20, 1, 1, '2007-02-26 16:23:56', '2007-02-26 16:23:56', 1, 'Mailer', 'mailer/', 'direct marketing solution', 'A professionally designed direct mailer with a considered creative message.', 'To start the direct marketing process, a mailer is a cost effective way to hit a large number of people. The carefully considered message and content is designed for the best response. You will receive advice on content, sizing, who to send to and additional despatch costs.', 1195, '1', 2),
(21, 1, 1, '2007-02-26 16:23:56', '2007-02-26 16:23:56', 1, 'Addressed mailer', 'addressed-mailer/', 'direct marketing solution', 'A professionally designed direct mailer with a considered creative message addressed and ready to go.', 'To start the direct marketing process, a mailer is a cost effective way to hit a large number of people. The carefully considered message and content is designed for the best response. When they are printed they are then digitally addressed and ready to go. You will receive advice on content, sizing, who to send to and additional despatch costs.', 1495, '1', 3),
(22, 1, 1, '2007-02-26 16:27:50', '2007-02-26 16:27:50', 1, 'Quarter page', 'quarter-page/', 'advertising solution', 'A budget level creative advertisement.', 'As a first step into advertising, a quarter page ad is a cost effective move to allow your budget to stretch to multiple insertions. You could extend this single ad offer to a number of similar ads to roll out over a long period. Despatch of final artwork to your chosen publication is included.', 395, '1', 4),
(23, 1, 1, '2007-02-26 16:27:50', '2007-02-26 16:27:50', 1, 'Full page or DPS', 'full-page-or-dps/', 'advertising solution', 'A full page creative advertisement including art direction and copywriting.', 'When the advertising budget is serious, a full page or DPS ad means you will get maximum impact from the page. You could extend this single ad offer to a full campaign of different ads to roll out over a long period. Your initial campaign concept is followed by final art direction and copywriting to complete the artwork. Despatch of final artwork to your chosen publication is included.', 995, '1', 5),
(24, 1, 1, '2007-02-26 16:31:35', '2007-02-26 16:31:35', 1, 'A3 poster', 'a3-poster/', 'advertising solution', 'An eye catching poster design with short print runs.', 'Posters are a very versatile promotional tool and crucial for keeping your audience updated with the latest information. This solution offers a simple design from your information and images, with modest production costs.', 695, '1', 6),
(25, 1, 1, '2007-02-26 16:31:35', '2007-02-26 16:31:35', 1, 'Web banner', 'web-banner/', 'advertising solution', 'An animated web banner advertisement for online promotion', 'There are many opportunities to advertise online with a web banner. Our commonly used format will mean your banner can be used on any number of websites. The simple animated file will convey almost any message in an eye catching way.', 295, '1', 7),
(26, 1, 1, '2007-02-26 16:49:52', '2007-02-26 16:49:52', 5, 'Roller banner', 'roller-banner/', 'display solution', 'Professional design and production of a banner stand.', 'This entry level display solution offers you a very popular and cost effective piece of hardware to use in any situation. Easy to setup and easy to transport with superior design and high quality production and hardware.', 995, '1', 2),
(27, 1, 1, '2007-02-26 16:49:52', '2007-02-26 16:49:52', 5, '3x3 Pop-up', '3x3-pop-up/', 'display solution', 'Professional design and production of a banner stand.', 'This impressive display system has proved to be one of the most popular solutions we provide. Very easy to setup and easy to transport in it\'s rugged carry case. Designed with end use in mind and produced to the highest standards using the best hardware.', 2395, '1', 3),
(28, 1, 1, '2007-02-26 16:52:45', '2007-02-26 16:52:45', 5, 'Touchscreen', 'touchscreen/', 'display solution', 'An interactive touchscreen PC solution for your customers and visitors.', 'The high tech answer to sharing information with members of the public or customers on site. Make use of your website content, manage the pages and do away with large amounts of printed paper to save both money and display space. Utilise features like multiple languages and product databases with more highly specified solutions.', 3195, '1', 4),
(29, 1, 1, '2007-02-26 16:52:45', '2007-02-26 16:52:45', 5, 'Vehicle wrap', 'vehicle-wrap/', 'display solution', 'For a flexible solution to applying the most creative vehicle liveries.', 'The latest techniques are now available to you for creating stunning vehicle wraps. Turn your promotional vehicles or fleet into a consistently presented, new looking canvas for absolutely any full colour design. Colorfast inks last for years and the vinyl offers a protective coating for paintwork.', 0, '1', 5),
(30, 1, 1, '2007-08-14 14:23:27', '2007-08-14 14:23:27', 1, 'E-shot design', 'e-shot-design/', 'solution', 'The first level of e-marketing', 'An ideal first step into e-marketing. An e-shot is a fast, cost effective way to reach your customers with a news bulletin or information on new products or services. A professionally designed e-shot is compiled from your text and images, created as html, approved, then sent to your list of up to 500 recipients. For power users, the same e-shot design could be used in our GoMail online e-shot solution to allow you to create, manage, send and monitor your own campaigns. ', 695, '1', 8);
