(1, 1, 1, '2007-03-02 10:51:12', '2007-03-02 10:51:12', 'The benefits include:', 'benefits'),
(2, 1, 1, '2007-03-02 10:51:12', '2007-03-02 10:51:12', 'You also get:', 'free'),
(3, 1, 1, '2007-03-02 10:51:27', '2007-03-02 10:51:27', 'Plus — with your first package or solution:', 'plus');
INSERT INTO `services_listing` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Service`, `Safe_URL`, `Description`) VALUES
(1, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Advertising', 'advertising/', 'One off ads or full campaigns. You can expect quality art direction and copywriting with total project management to deal with artwork and publications.'),
(2, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Copywriting', 'copywriting/', 'For use in advertising, brochures, websites or technical documents you will get expertly written copy or meticulous copy editing.'),
(3, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Direct Marketing', 'direct-marketing/', 'Using a range of media, a direct marketing effort is undertaken to generate a specific response which can be tracked and measured.'),
(4, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Exhibitions, displays & instore', 'exhibitions-displays-instore/', 'Everything from banner stands and pop-up displays to custom exhibition builds and instore displays, including point-of-sale.'),
(5, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Graphic design', 'graphic-design/', 'The majority of our activities depend on our core discipline - design. You have at your disposal a world class team.'),
(6, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Illustration', 'illustration/', 'Our professional illustrators offer traditional and contemporary drawing skills including airbrush, calligraphy, caricatures and digital illustration.'),
(7, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Blog creation', 'blog-creation/', 'A Blog (or Weblog) is an online diary where viewers can add comments. You can have one as part of a new or existing website or if you wish as a stand alone site.'),
(8, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Customer surveys', 'customer-surveys/', 'Often the first step is to gauge your customers opinions. You may wish to use focus groups, telephone interviews or written/online surveys.'),
(9, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'E-commerce solutions', 'ecommerce-solutions/', 'Online selling is still growing rapidly. There are many solutions available to help you sell your products and services to a worldwide audience.'),
(10, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'E-marketing', 'emarketing/', 'Usually part of the direct marketing activity. E-shots and online activity in the form of mini sites can be very cost effective tools.'),
(11, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Event marketing', 'event-marketing/', 'Our associates are on hand to share their vast experience in all scales of event marketing worldwide.'),
(12, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Interactive presentations', 'interactive-presentations/', 'Compiled using which ever tools are most appropriate in either powerpoint, html, flash or keynote for all levels of interaction.'),
(13, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Media planning & buying', 'media-planning-buying/', 'An important part of your advertising campaign is choosing the right publications. Our associates will do this for you and make the most of your budget.'),
(14, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'New media', 'new-media/', 'Traditional forms of presentation are constantly being transformed into digital formats. Lately there is growing interest in our touchscreen capabilities.'),
(15, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Photography', 'photography/', 'Commercial photographers and art directors are always on hand for national and international commissions for all types of project.'),
(16, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'PR', 'pr/', 'A very important and cost effective part of your marketing activity. We can offer sector specific expertise for all PR activity.'),
(17, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Print production & buying', 'print-production-buying/', 'Many years of trade print buying means you get the best prices and the best service without getting tangled up in the complexities.'),
(18, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Web based software solutions', 'web-based-software-solutions/', 'A growing proportion of online activity now consists of management applications to allow online working and collaborative sites with user generated content.'),
(19, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Web design, development & management', 'web-design-development-management/', 'Unlimited possibilities are available to you in this area. You have a young development team with outstanding ability and cutting edge skills. '),
(20, 1, 1, '2007-02-21 16:26:04', '2007-02-21 16:26:04', 'Web marketing', 'web-marketing/', 'Everyone wants their site to be at the top of a Google search or getting maximum traffic. There are a number of tools at our disposal to achieve this.');
