INSERT INTO `testimonials` (`ID`, `CreatedID`, `UpdatedID`, `Created`, `Updated`, `Portfolio_Company_ID`, `Portfolio_Detail_ID`, `Forename`, `Surname`, `Role`, `Description`, `Active`) VALUES
(1, 1, 1, '2007-07-03 12:12:02', '2007-07-03 12:12:02', 20, 0, 'Andrew', 'Cooper', 'Project Manager', 'creation approach their work with care, paying close attention to detail, always offering honest advice and guidance', '1'),
(2, 1, 1, '2007-07-03 12:15:16', '2007-07-03 12:15:16', 29, 0, 'John', 'Fontaine', 'Director of Marketing', 'Their approach is innovative and imaginative, they have often suggested new approaches or strategies appreciated by both students and staff.', '1'),
(3, 1, 1, '2007-07-03 12:15:16', '2007-07-03 12:15:16', 36, 0, 'Duncan', 'Blakemore', 'Managing Director', 'I am sure the professional image you helped us to achieve helped our company\'s success at the show.', '1'),
(4, 1, 1, '2007-07-03 12:16:21', '2007-07-03 12:16:21', 27, 0, 'Julie', 'Hemmings', 'Publicity/Marketing Manager', 'creation deliver everytime with enthusiasm and creativity – nothing is too much trouble', '1'),
(5, 1, 1, '2007-07-03 12:19:29', '2007-07-03 12:19:29', 15, 0, 'Nick', 'Speirs', 'Managing Director', 'creation have, at all times, responded with excellent ideas, one of their strengths being their creative ability.', '1'),
(6, 1, 1, '2007-07-03 12:19:29', '2007-07-03 12:19:29', 22, 0, 'Kate', 'Fowler', 'Charity Coordinator', 'I have used creation for a number of years and have been more than satisfied with their work. Their name suits them well.', '1');
